INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (1, 'Thợ Săn Thành Phố: Căn Cứ Bí Mật Shinjuku', 'https://i.moveek.com/media/resized/short/5cf770f7edec0367991330.jpg', '', 'Ryo Saeba là một tay bắn tỉa, đồng thời là một thám tử tư hiện đang hoạt động tại Shinjuku, Tokyo, Nhật Bản. Ryo sở hữu một khả năng thiện xạ vô song, tuy nhiên lại mang nỗi ám ảnh quá mức đối với người khác giới. Anh và cộng sự Kaori Makimura làm vệ sĩ và thực hiện các nhiệm vụ khác cho khách hàng của mình. Khách hàng mới nhất của họ là Ai Shindo, một người mẫu bị tấn công bởi những người bí ẩn và vô tình nắm giữ chìa khóa cho một âm mưu mang tính rộng lớn bao trùm lấy cả thành phố. Liệu họ cần phải làm gì để ngăn chặn âm mưu đó nhằm giải cứu cả thành phố xinh đẹp?', '2019-06-13 17:00:00.000000', 100, 0, '2019-06-17 08:46:07.807000', '2019-06-17 08:46:07.807000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (2, 'Sát Thủ John Wick 3: Chuẩn Bị Chiến Tranh', 'https://i.moveek.com/media/cache/poster_small/media/80d28d67b67ed5f5616446d5f5997effc060ba52.jpg', 'https://www.youtube.com/embed/KBo2FboQ60U?hd=1', 'John Wick đang bị săn đuổi bởi một Hợp đồng Mở với giá trị tiền thưởng $14 triệu cho mạng sống của mình khắp thế giới, và bởi vì đã phá luật chơi: giết người ngay trong lãnh địa của Continental Hotel.', '2019-05-16 17:00:00.000000', 127, 0, '2019-06-17 08:46:16.999000', '2019-06-17 08:46:16.999000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (3, 'Thợ Săn Thành Phố: Căn Cứ Bí Mật Shinjuku', 'https://i.moveek.com/media/resized/short/5cf770f7edec0367991330.jpg', 'https://www.youtube.com/embed/21e9UKPL7-o?hd=1', 'Ryo Saeba là một tay bắn tỉa, đồng thời là một thám tử tư hiện đang hoạt động tại Shinjuku, Tokyo, Nhật Bản. Ryo sở hữu một khả năng thiện xạ vô song, tuy nhiên lại mang nỗi ám ảnh quá mức đối với người khác giới. Anh và cộng sự Kaori Makimura làm vệ sĩ và thực hiện các nhiệm vụ khác cho khách hàng của mình. Khách hàng mới nhất của họ là Ai Shindo, một người mẫu bị tấn công bởi những người bí ẩn và vô tình nắm giữ chìa khóa cho một âm mưu mang tính rộng lớn bao trùm lấy cả thành phố. Liệu họ cần phải làm gì để ngăn chặn âm mưu đó nhằm giải cứu cả thành phố xinh đẹp?', '2019-06-13 17:00:00.000000', 100, 0, '2019-06-17 08:46:17.375000', '2019-06-17 08:46:17.375000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (4, 'Aladdin', 'https://i.moveek.com/media/resized/short/5cd505413a53a218776025.jpg', 'https://www.youtube.com/embed/aAxfky411DA?hd=1', 'Kinh thành Agrabah phồn hoa, rực rỡ giữa lòng sa mạc, nơi luôn có những cuộc náo loạn do chàng thanh niên Aladdin tạo ra. Sinh ra và lớn lên tại khu ổ chuột cùng chú khỉ cưng Abu, Aladdin, nắm rõ từng ngóc ngách của thành phố nên anh có thể dễ dàng qua mặt bọn binh lính hoàng gia..', '2019-05-23 17:00:00.000000', 128, 0, '2019-06-17 08:46:19.089000', '2019-06-17 08:46:19.089000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (5, 'Hellboy', 'https://i.moveek.com/media/resized/short/5c8b896a6973c285633874.jpg', 'https://www.youtube.com/embed/XVv8iIFM2Po?hd=1', 'Bối cảnh mới tại thành phố London, Anh Quốc. Vốn là thủ đô của nhiều truyền thuyết nổi tiếng với cộng đồng thế giới, đặc biệt là thanh kiếm quyền năng của King Arthur.', '2019-04-11 17:00:00.000000', 118, 0, '2019-06-17 08:46:21.148000', '2019-06-17 08:46:21.148000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (6, 'Cuộc Gọi Định Mệnh', 'https://i.moveek.com/media/resized/short/5c6977ef3aa40148212995.jpg', 'https://www.youtube.com/embed/_gVj4Zk_cVc?hd=1', 'Hiền, một cô gái bị bạn trai sắp cưới lừa gạt tình cảm. Cô thất vọng, lao vào tìm kiếm một mối quan hệ mới và làm quen với một chàng trai qua điện thoại. Ngẫu nhiên, anh là giám đốc khó tính ở công ty cô mới vào làm. Cả hai ít cơ hội tiếp xúc nên không nhận ra giọng nhau. Tình cảm nảy sinh sau những cuộc gọi tâm sự, họ quyết định gặp nhau.', '2019-02-28 17:00:00.000000', 93, 0, '2019-06-17 08:46:22.698000', '2019-06-17 08:46:22.698000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (7, 'Vô Gian Đạo', 'https://i.moveek.com/media/resized/short/5cc8ffce0c4f7731718778.jpg', 'https://www.youtube.com/embed/foGeq3pCT88?hd=1', 'Vô Gian Đạo khai thác câu chuyện phức tạp trong thế giới đầy lọc lừa của những tay bịp thông qua mối quan hệ giữa Cháy, Đạo, Thạch và Tâm. Cháy là anh chàng giỏi bài bạc bịp và mê gái. Trong dịp tình cờ, Cháy phải lòng Linh – cô nàng xinh đẹp nhưng lại bị mù đôi mắt. Vẻ đẹp trong trẻo của Linh đã khiến Cháy rung động và phải trổ hết tài chinh phục.', '2019-05-23 17:00:00.000000', 113, 0, '2019-06-17 08:46:22.978000', '2019-06-17 08:46:22.978000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (8, 'Yêu Nhầm Sếp Bự', 'https://i.moveek.com/media/resized/short/5ce4bbfda47ee147826020.jpg', 'https://www.youtube.com/embed/3-nsIAcjqSY?hd=1', 'Fred Flarsky là một nhà báo tài năng, anh làm việc tự do, đồng thời có mối quan hệ rắc rối. Hồi thiếu niên, Fred yêu Charlotte Field và đến giờ thì cả hai không còn bất cứ liên lạc nào. Trong một lần tình cờ, họ gặp lại nhau nhưng hoàn cảnh và địa vị lại khác nhau quá xa, Charlotte đã là một nhà ngoại giao đầy quyền lực và đang có kế hoạch tranh cử tổng thống. Fred tiếp cận và cố gắng quyến rũ Charlotte bằng sự tự tin, dí dỏm và cả những hiểu biết về tính cách của cô ấy. Liệu anh chàng đáng yêu này có thể một lần nữa "cưa đổ" cô nàng quyền lực xinh đẹp.', '2019-06-06 17:00:00.000000', 125, 0, '2019-06-17 08:46:23.516000', '2019-06-17 08:46:23.516000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (9, 'Trạng Quỳnh', 'https://i.moveek.com/media/resized/short/5c1c55d7736df628153294.jpg', 'https://www.youtube.com/embed/2jvNTypICvA?hd=1', 'Trạng Quỳnh sẽ xoay quanh hành trình giải cứu thầy Đoàn, đồng thời là cha Điềm đầy gian truân nhưng cũng nhiều tiếng cười của những con người nhỏ bé trong xã hội phong kiến dù luôn bị chèn ép bởi tầng lớp quan lại bất công.', '2019-02-04 17:00:00.000000', 95, 0, '2019-06-17 08:46:23.576000', '2019-06-17 08:46:23.576000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (10, 'Ngôi Đền Kỳ Quái', 'https://i.moveek.com/media/cache/poster_small/media/5cc9a26d0d772762542474.jpg', 'https://www.youtube.com/embed/Wj7cRdL3pQI?hd=1', 'Ba chàng trai trên đường đến gặp một nhà sư, nhưng họ lại không nhận ra ngôi đền mà họ sẽ nhận chức sắc đã bị nguyền rủa bởi cơn thịnh nộ của Pee Nak - một con rắn khổng lồ trong huyền thoại.', '2019-05-23 17:00:00.000000', 110, 0, '2019-06-17 08:46:24.142000', '2019-06-17 08:46:24.142000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (11, 'Nàng Dâu Bị Nguyền', 'https://i.moveek.com/media/resized/short/5c372c6a348ce357740833.jpg', 'https://www.youtube.com/embed/quX6dz7wC1Q?hd=1', 'Bi kịch của gia tộc họ Lee - gia tộc có ba cậu con trai nhưng tất cả đều chết một cách bí ẩn vào đúng đêm tân hôn.', '2019-01-24 17:00:00.000000', 91, 0, '2019-06-17 08:46:24.188000', '2019-06-17 08:46:24.188000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (12, 'Chị Trợ Lý Của Anh', 'https://i.moveek.com/media/resized/short/5c1a4cba08d1d269919956.jpg', 'https://www.youtube.com/embed/hgtxWxP5uBM?hd=1', 'Một nữ doanh nhân xinh đẹp, tài năng, đam mê công việc và đầy tham vọng; vì muốn cứu doanh nghiệp của gia đình thoát khỏi âm mưu thâu tóm của các cổ đông, cô phải chấp nhận một điều kiện là đang từ vị trí Phó tổng giám đốc một công ty Sữa chuyển sang làm Trợ lý cho một anh chàng thiếu gia “playboy” trẻ tuổi hơn – là Giám đốc một công ty Cà Phê cùng với nhiệm vụ phải tìm cho anh ta một cô bạn gái.', '2019-01-03 17:00:00.000000', 110, 0, '2019-06-17 08:46:24.408000', '2019-06-17 08:46:24.408000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (13, 'Doraemon: Nobita và Mặt Trăng Phiêu Lưu Ký', 'https://i.moveek.com/media/resized/short/5cca9b9047e54118071696.jpeg', 'https://www.youtube.com/embed/O61aTrlHJRA?hd=1', 'Dựa trên truyện cổ dân gian của người Nhật rằng trên cung trăng có loài thỏ sinh sống ở đó, phim lấy bối cảnh trên mặt trăng cùng nội dung nhấn mạnh vào tình bạn được liên kết mạnh mẽ bởi "sức mạnh của niềm tin". Nhân vật mới xuất hiện là Lunna- một cô gái bí ẩn sống ở mặt trăng, và cuộc hành trình đầy cam go và khó khăn của nhóm Nobita trên con đường khám phá mặt trăng cũng như chống lại ác nhân Diabolo cùng tên hầu cận gian manh Goddard.', '2019-05-23 17:00:00.000000', 120, 0, '2019-06-17 08:46:24.504000', '2019-06-17 08:46:24.504000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (14, 'Đường Hầm Tội Ác', 'https://i.moveek.com/media/resized/short/5ce6a8de9918d499650618.jpg', 'https://www.youtube.com/embed/EbND2NLOHPw?hd=1', 'Kỹ sư máy tính bị liệt Joaquin bắt đầu nghe thấy giọng nói và những âm thanh lạ lùng từ tầng hầm. Sau khi bí mật theo dõi mọi động tĩnh của những người hàng xóm, ông phát hiện một kế hoạch hiểm độc. Cùng lúc đó, một phụ nữ trẻ lạ mặt tới thuê trọ tại nhà Joaquin.', '2019-05-30 17:00:00.000000', 120, 0, '2019-06-17 08:46:25.253000', '2019-06-17 08:46:25.253000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (16, 'Chúa Tể Godzilla', 'https://i.moveek.com/media/resized/short/5cd44f6acfd41775732279.jpg', 'https://www.youtube.com/embed/HMXnrOd7e6E?hd=1', 'Chúa Tể Godzilla tập trung vào cuộc đụng độ các thành viên tổ chức Monarch với những quái thú khổng lồ - Rodan, Mothra, và King Ghidorah. Khi những quái vật huyền thoại trỗi dậy, chúng sẽ tranh giành quyền lực tối cao để thống trị thế giới. Do vậy, loài người sẽ phải đấu tranh để đem lại sự cân bằng trước những hiểm họa diệt vong đó.', '2019-05-30 17:00:00.000000', 131, 0, '2019-06-17 08:46:25.354000', '2019-06-17 08:46:25.354000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (18, 'Trùm, Cớm và Ác Quỷ', 'https://i.moveek.com/media/cache/poster_small/media/5cda4fe40671e612399846.jpg', 'https://www.youtube.com/embed/U07i0nsV0Oo?hd=1', 'Trùm, Cớm và Ác Quỷ sẽ là cuộc đi săn của người tạo ra luật – Cớm, kẻ chuyên phá luật – gã Trùm – trước kẻ giết người hàng loạt mà họ gọi là Ác Quỷ.', '2019-05-30 17:00:00.000000', 110, 0, '2019-06-17 08:46:26.178000', '2019-06-17 08:46:26.178000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (21, 'Đặc Vụ Áo Đen - Sứ Mệnh Toàn Cầu', 'https://i.moveek.com/media/resized/short/5cc16c751e29d954588711.jpg', 'https://www.youtube.com/embed/bQv_gWmeU7s?hd=1', 'Bấy lâu nay, Đặc vụ Áo Đen luôn là những người hùng thầm lặng “ngầu” nhất, bảo vệ Trái Đất khỏi những hiểm họa xấu xa ngoài hành tinh. Trong cuộc phiêu lưu mới này, họ phải đối mặt với mối đe dọa mang tính toàn cầu lớn nhất từ trước đến giờ: truy tìm điệp viên hai mang ẩn mình trong tổ chức Đặc vụ Áo Đen.', '2019-06-13 17:00:00.000000', 115, 0, '2019-06-17 08:46:26.878000', '2019-06-17 08:46:26.878000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (24, 'Vu Quy Đại Náo', 'https://i.moveek.com/media/resized/short/5c46a63ac3178577591914.jpg', 'https://www.youtube.com/embed/Fptn6pXAZRI?hd=1', 'Vu Quy Đại Náo kể về bộ ba bạn thân Trang, Hiền và Hoàng là những người trẻ có tâm hồn tự do yêu đương, coi “ế là xu thế” nhưng đang phải đối mặt với sức ép kết hôn từ phía gia đình: ông nội, dì và anh chị - đại diện cho thế hệ phụ huynh chẳng mong gì ngoài việc con em mình sớm yên bề gia thất. Tư tưởng mâu thuẫn đó trong cả 3 gia đình là một thực tế không ít bi hài.', '2019-02-21 17:00:00.000000', 110, 0, '2019-06-17 08:46:27.658000', '2019-06-17 08:46:27.658000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (27, 'Giáp Thần Gundam: Ký Ức Chiến Binh', 'https://i.moveek.com/media/resized/short/5c618652da66e508111566.jpg', 'https://www.youtube.com/embed/jZYflDyRjzc?hd=1', 'Năm U.C.0096, sau sự kiện chấn động "Laplace Incident" dẫn đến sự suy tàn của đế chế Neo Zeon, 2 bộ giáp chiến hùng mạnh Unicorn Gundam và Banshee bị phong tỏa và cất giữ bởi Chính Quyền Liên Bang. Tuy nhiên năm U.C.0097, một bộ giáp Gundam thứ 3 bỗng nhiên xuất hiện mệnh danh là Phenex và trở thành mục tiêu đuổi bắt của cả hai thế lực là Chính Quyền Liên Ban và Neo-Zeon cùng với âm mưu che giấu tội ác phía sau những con người mang năng lực dự đoán tương lai Newtypes.', '2019-02-14 17:00:00.000000', 90, 0, '2019-06-17 08:46:28.160000', '2019-06-17 08:46:28.160000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (29, 'Trùm, Cớm và Ác Quỷ', 'https://i.moveek.com/media/cache/poster_small/media/5cda4fe40671e612399846.jpg', 'https://www.youtube.com/embed/U07i0nsV0Oo?hd=1', 'Trùm, Cớm và Ác Quỷ sẽ là cuộc đi săn của người tạo ra luật – Cớm, kẻ chuyên phá luật – gã Trùm – trước kẻ giết người hàng loạt mà họ gọi là Ác Quỷ.', '2019-05-30 17:00:00.000000', 110, 0, '2019-06-17 08:46:29.223000', '2019-06-17 08:46:29.223000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (31, 'Vô Gian Đạo', 'https://i.moveek.com/media/resized/short/5cc8ffce0c4f7731718778.jpg', 'https://www.youtube.com/embed/foGeq3pCT88?hd=1', 'Vô Gian Đạo khai thác câu chuyện phức tạp trong thế giới đầy lọc lừa của những tay bịp thông qua mối quan hệ giữa Cháy, Đạo, Thạch và Tâm. Cháy là anh chàng giỏi bài bạc bịp và mê gái. Trong dịp tình cờ, Cháy phải lòng Linh – cô nàng xinh đẹp nhưng lại bị mù đôi mắt. Vẻ đẹp trong trẻo của Linh đã khiến Cháy rung động và phải trổ hết tài chinh phục.', '2019-05-23 17:00:00.000000', 113, 0, '2019-06-17 08:46:30.804000', '2019-06-17 08:46:30.804000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (36, 'Vu Quy Đại Náo', 'https://i.moveek.com/media/resized/short/5c46a63ac3178577591914.jpg', 'https://www.youtube.com/embed/Fptn6pXAZRI?hd=1', 'Vu Quy Đại Náo kể về bộ ba bạn thân Trang, Hiền và Hoàng là những người trẻ có tâm hồn tự do yêu đương, coi “ế là xu thế” nhưng đang phải đối mặt với sức ép kết hôn từ phía gia đình: ông nội, dì và anh chị - đại diện cho thế hệ phụ huynh chẳng mong gì ngoài việc con em mình sớm yên bề gia thất. Tư tưởng mâu thuẫn đó trong cả 3 gia đình là một thực tế không ít bi hài.', '2019-02-21 17:00:00.000000', 110, 0, '2019-06-17 08:46:31.814000', '2019-06-17 08:46:31.814000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (39, 'Tình Đầu Thơ Ngây', 'https://i.moveek.com/media/resized/short/5c2db7eec423c880285153.png', 'https://www.youtube.com/embed/Wgl5V_0TFQo?hd=1', 'Vào một ngày đẹp trời, cuộc sống của bạn bỗng trở nên hỗn độn với sự xuất hiện của một cô bé lớp dưới, lẽo đẽo đi theo mình cả ngày, không những vậy còn… dọn luôn về nhà mình ở.', '2019-02-13 17:00:00.000000', 85, 0, '2019-06-17 08:46:32.139000', '2019-06-17 08:46:32.139000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (42, 'X-Men: Phượng Hoàng Bóng Tối', 'https://i.moveek.com/media/resized/short/5cfbbf5bb78e9110007698.jpg', 'https://www.youtube.com/embed/2uMTR1DhA04?hd=1', 'X-Men: Phượng Hoàng Bóng Tối là phần mở rộng của vũ trụ X-Men khi Jean Grey thức tỉnh và lĩnh hội được Phoenix Force (Thế Lực Phượng Hoàng) - đại diện cho tổng năng lượng, sức mạnh của vạn thể đã và luôn tồn tại. Nguồn sức mạnh vô tận đem lại cho Jean Grey năng lực khủng khiếp nhưng mặt tối của sức mạnh cũng thức tỉnh theo. Liệu nhóm X-Men sẽ làm gì để ngăn chặn sự diệt vong của nhân loại do Jean Grey cùng Phoenix Force gây ra?', '2019-06-06 17:00:00.000000', 111, 0, '2019-06-17 08:46:32.579000', '2019-06-17 08:46:32.579000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (15, 'Người Hỏa Tiễn', 'https://i.moveek.com/media/resized/short/5ce625f976e52241524173.jpg', 'https://www.youtube.com/embed/H744TrEfF0A?hd=1', 'Người Hỏa Tiễn là câu chuyện về con đường âm nhạc từ thuở ấu thơ đến đỉnh cao danh vọng đầy cuồng nhiệt và vô vàn thăng trầm của Elton John – một trong những tượng đài bất hủ của nền làng nhạc thế giới.', '2019-06-13 17:00:00.000000', 121, 0, '2019-06-17 08:46:25.326000', '2019-06-17 08:46:25.326000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (17, 'Người Vợ Ma', 'https://i.moveek.com/media/resized/short/5c3d8e5226652041298733.jpg', 'https://www.youtube.com/embed/Dqw5UMZpdd0?hd=1', 'Nard và Mac là một cặp đôi trong trường trung học. Trong một lần quá trớn, Nard vô tình mang thai và từ đây, tình cảm của đôi trẻ bắt đầu gặp nhiều biến cố. Mẹ của Mac bắt cả hai phải chấm dứt ngay mối quan hệ và tìm mọi cách đưa Mac ra nước ngoài du học. Trong khi đó mẹ của Nard thì thuyết phục cô bỏ đứa bé trong bụng. Nhưng điều tồi tệ đã xảy ra, Nard và con cô đều chết trên bàn phẫu thuật. Vì quá phẫn uất hồn ma của Nard không siêu thoát mà luẩn quẩn ở dương thế với hi vọng một ngày Mac trở về và tìm mẹ con cô.', '2019-01-17 17:00:00.000000', 99, 0, '2019-06-17 08:46:25.493000', '2019-06-17 08:46:25.493000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (19, 'Yêu Nhầm Sếp Bự', 'https://i.moveek.com/media/resized/short/5ce4bbfda47ee147826020.jpg', 'https://www.youtube.com/embed/3-nsIAcjqSY?hd=1', 'Fred Flarsky là một nhà báo tài năng, anh làm việc tự do, đồng thời có mối quan hệ rắc rối. Hồi thiếu niên, Fred yêu Charlotte Field và đến giờ thì cả hai không còn bất cứ liên lạc nào. Trong một lần tình cờ, họ gặp lại nhau nhưng hoàn cảnh và địa vị lại khác nhau quá xa, Charlotte đã là một nhà ngoại giao đầy quyền lực và đang có kế hoạch tranh cử tổng thống. Fred tiếp cận và cố gắng quyến rũ Charlotte bằng sự tự tin, dí dỏm và cả những hiểu biết về tính cách của cô ấy. Liệu anh chàng đáng yêu này có thể một lần nữa "cưa đổ" cô nàng quyền lực xinh đẹp.', '2019-06-06 17:00:00.000000', 125, 0, '2019-06-17 08:46:26.497000', '2019-06-17 08:46:26.497000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (20, 'Người Quen Xa Lạ', 'https://i.moveek.com/media/resized/short/5c1b1a0781357629317812.jpg', 'https://www.youtube.com/embed/7KlMKzyWNz0?hd=1', 'Một nhóm bạn thân thiết với nhau đã 30 năm. Một đêm nọ, họ tụ họp tại một buổi tiệc tân gia ấm cúng và cùng tán gẫu. Những câu chuyện phiếm, những kỉ niệm năm xưa ùa về khiến họ vô cùng vui vẻ. Trong không khí phấn khích đó, một người trong nhóm đã đề nghị các “tri kỉ” hãy đặt điện thoại lên bàn để bất kì cuộc điện thoại, tin nhắn nào đổ chuông tới cũng phải chia sẻ cùng nhau.', '2019-01-03 17:00:00.000000', 115, 0, '2019-06-17 08:46:26.549000', '2019-06-17 08:46:26.549000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (22, 'Con Nuôi Bất Đắc Dĩ', 'https://i.moveek.com/media/cache/poster_small/media/0c0c3bc1a6ff4dd50b0dfeed5a23ed3540992a1c.jpg', 'https://www.youtube.com/embed/tDhWHXRSFC4?hd=1', 'Câu chuyện hài hước về cặp vợ chồng Pete và Ellie khi quyết định trở thành ba mẹ nuôi của 3 đứa trẻ với 3 độ tuổi và tính cách khác nhau: Cô gái tuổi teen Lizzy, cậu bé ngốc nghếch Juan và cô út luôn la hét Lita.', '2019-01-10 17:00:00.000000', 118, 0, '2019-06-17 08:46:27.288000', '2019-06-17 08:46:27.288000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (23, 'Đường Về Nhà Của Cún Con', 'https://i.moveek.com/media/resized/short/5c2f22334dbd0839620797.jpg', 'https://www.youtube.com/embed/XwA4a3oqEGg?hd=1', 'Trong một lần mải mê đuổi sóc, Bella đi lạc rất xa khỏi căn nhà của mình. Cô nàng được một gia đình tìm thấy và đưa về nơi ở mới. Nhưng những thứ lạ lẫm kia chẳng hề có hình bóng quen thuộc của Lucas. Sợ rằng cậu chủ đang đợi chờ mình trong cô đơn, nàng cún bất chấp mọi rủi ro để tự tìm đường về nhà và chuẩn bị đối mặt với bao gian khó trước mắt', '2019-01-10 17:00:00.000000', 95, 0, '2019-06-17 08:46:27.406000', '2019-06-17 08:46:27.406000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (25, 'Táo Quậy', 'https://i.moveek.com/media/resized/short/5c3c8b8b0c608537094463.jpg', 'https://www.youtube.com/embed/4pHGnN6Xq70?hd=1', 'Táo Quậy, vị thần cai quản bếp nhà Minh, một cậu thiếu gia ham chơi. Một tai nạn bất ngờ xảy ra làm cho cả hai dính vào nhau bằng một sợi dây phép thuật.', '2019-02-04 17:00:00.000000', 102, 0, '2019-06-17 08:46:27.727000', '2019-06-17 08:46:27.727000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (26, 'Đẳng Cấp Thú Cưng 2', 'https://i.moveek.com/media/resized/short/5c204620a84cb745296939.jpg', 'https://www.youtube.com/embed/5UgcBLRLfGs?hd=1', 'Cũng như bao thú cưng khác, khi đến phòng khám Max đã không giấu nổi vẻ âu lo trên khuôn mặt. Đã vậy, chú chó tội nghiệp còn gặp thêm nhiều người bạn đồng loại vô cùng bất bình thường. Đầu tiên là chú mèo xám thân thiện bắt chuyện với Max, trấn an cậu rằng bác sĩ thú y ở đây rất giỏi nhất ngành về chữa trị chứng… rối loạn cư xử. Và rồi thì chú mèo bắt đầu “nổi đóa” cào cấu chủ. Lần lượt sau đó Max được gặp chú chuột hamster xám điên cuồng “chạy bộ” giảm cân, một chú chó nâu luôn phân vân rằng liệu mình có đủ ngoan, lại còn cả một cặp mèo sinh đôi có nụ cười vô cùng quái dị. Tránh vỏ dưa lại gặp vỏ dừa, Max vốn đã âu lo lại càng trở nên sợ sệt hơn với cuộc thăm khám trước mắt.', '2019-06-06 17:00:00.000000', 86, 0, '2019-06-17 08:46:27.974000', '2019-06-17 08:46:27.974000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (28, 'Diệp Vấn Ngoại Truyện: Trương Thiên Chí', 'https://i.moveek.com/media/cache/poster_small/media/b4b7d50956c8a0a6c37a6607f77fa7b550498b0c.jpg', 'https://www.youtube.com/embed/bqyFZlw4KgQ?hd=1', 'Sau trận thua trước Diệp Vấn, Trương Thiên Chí quyết định sống ẩn danh cùng gia đình nhỏ của mình. Tuy nhiên, rắc rối bắt đầu ập tới, khiến Trương Thiên Chí phải bị lôi vào một cuộc đối đầu máu lửa với những kẻ thù đến từ ngoại quốc.', '2019-01-10 17:00:00.000000', 107, 0, '2019-06-17 08:46:28.794000', '2019-06-17 08:46:28.794000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (30, 'Chỉ Cần Em Hạnh Phúc', 'https://i.moveek.com/media/resized/short/5c2f762661fc5039338126.jpg', 'https://www.youtube.com/embed/SM87W3Ol3mA?hd=1', 'K và Cream gặp nhau năm 16 tuổi tại trường trung học và dần thân thiết như người trong gia đình. Năm tháng thôi qua, K đi làm cho một hãng thu âm và Cream trở thành nhạc sĩ, họ vẫn sống với nhau dù không phải là một đôi. Một ngày kia, K bị chẩn đoán mắc bệnh bạch cầu, K do dự không tiết lộ bệnh tình của mình cũng như thổ lộ tình yêu với Cream vì sợ cô tổn thương. Trước khi không còn thời gian, K phải làm mọi thứ để Cream có thể ổn định và hạnh phúc.', '2019-01-10 17:00:00.000000', 106, 0, '2019-06-17 08:46:30.634000', '2019-06-17 08:46:30.634000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (32, 'Cà Chớn, Anh Đừng Đi', 'https://i.moveek.com/media/resized/short/5c81d94da4632057901947.jpg', 'https://www.youtube.com/embed/5xDAvoHIFus?hd=1', 'Vốn theo học ngành sáng tác nhạc, Tuệ Nhi đang rất đau đầu vì chưa tìm được lời hát tâm đắc cho ca khúc mà mình chấp bút. Vào ngày nọ, vận mệnh xui khiến cô gặp gỡ Hải Sơn, gã họa sĩ lang bạt chuyên vẽ tranh chân dung. Ấn tượng trước khả năng thi phú dạt dào ở chàng thanh niên, Nghi liền mạnh dạn nhờ Sơn viết lời giúp mình. Trải qua hàng loạt tình huống dở khóc dở cười, cả hai chợt nhận ra mình đã có tình cảm với đối phương lúc nào chẳng hay.', '2019-05-16 17:00:00.000000', 90, 0, '2019-06-17 08:46:31.166000', '2019-06-17 08:46:31.166000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (33, 'Yolo - Bạn Chỉ Sống Một Lần', 'https://i.moveek.com/media/resized/short/5c243886b220e679292558.jpg', 'https://www.youtube.com/embed/QvlVrFSP79I?hd=1', 'Những người trẻ dấn thân theo đuổi đam mê âm nhạc, đặc biệt là “thế giới ngầm” - underground. Để thỏa mãn đam mê ca hát với cá tính âm nhạc của riêng mình, họ phải trải qua nhiều sóng gió và nỗ lực không ngừng để khẳng định bản thân. Những cám dỗ, mảnh tối của giới giải trí cũng là những thách thức để người bạn trẻ này đối mặt và không vấp ngã.', '2019-01-10 17:00:00.000000', 111, 0, '2019-06-17 08:46:31.181000', '2019-06-17 08:46:31.181000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (35, 'X-Men: Phượng Hoàng Bóng Tối', 'https://i.moveek.com/media/resized/short/5cfbbf5bb78e9110007698.jpg', 'https://www.youtube.com/embed/2uMTR1DhA04?hd=1', 'X-Men: Phượng Hoàng Bóng Tối là phần mở rộng của vũ trụ X-Men khi Jean Grey thức tỉnh và lĩnh hội được Phoenix Force (Thế Lực Phượng Hoàng) - đại diện cho tổng năng lượng, sức mạnh của vạn thể đã và luôn tồn tại. Nguồn sức mạnh vô tận đem lại cho Jean Grey năng lực khủng khiếp nhưng mặt tối của sức mạnh cũng thức tỉnh theo. Liệu nhóm X-Men sẽ làm gì để ngăn chặn sự diệt vong của nhân loại do Jean Grey cùng Phoenix Force gây ra?', '2019-06-06 17:00:00.000000', 111, 0, '2019-06-17 08:46:31.770000', '2019-06-17 08:46:31.770000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (38, 'Tử Địa Báo Thù', 'https://i.moveek.com/media/resized/short/5c3f4bab3c851474637394.jpg', 'https://www.youtube.com/embed/NmaMdOtHBbo?hd=1', 'Sát thủ khét tiếng Roy Cady được chẩn đoán bị ung thư phổi ở tuổi 40 và không thể tiếp tục công việc của mình. Trước khi ung thư có thể giết chết Roy thì các ông chủ của Roy muốn thủ tiêu anh trước vì anh nắm quá nhiều thông tin mật của tổ chức.', '2019-01-17 17:00:00.000000', 94, 0, '2019-06-17 08:46:32.034000', '2019-06-17 08:46:32.034000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (41, 'Cua Lại Vợ Bầu', 'https://i.moveek.com/media/resized/short/5c3d4dafd255d392786021.jpg', 'https://www.youtube.com/embed/vfQsaG5FkN4?hd=1', 'Chuyện tình của Trọng Thoại và Nhã Linh đang hoàn hảo cho đến khi người yêu cũ của Nhã Linh là Quý Khánh thình lình xuất hiện và gây nên hàng loạt xáo trộn trong trái tim cô gái.', '2019-02-04 17:00:00.000000', 102, 0, '2019-06-17 08:46:32.498000', '2019-06-17 08:46:32.498000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (44, 'Hellboy', 'https://i.moveek.com/media/resized/short/5c8b896a6973c285633874.jpg', 'https://www.youtube.com/embed/XVv8iIFM2Po?hd=1', 'Bối cảnh mới tại thành phố London, Anh Quốc. Vốn là thủ đô của nhiều truyền thuyết nổi tiếng với cộng đồng thế giới, đặc biệt là thanh kiếm quyền năng của King Arthur.', '2019-04-11 17:00:00.000000', 118, 0, '2019-06-17 08:46:32.676000', '2019-06-17 08:46:32.676000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (48, 'Ước Hẹn Mùa Thu', 'https://i.moveek.com/media/resized/short/5cac66225de2c172114366.jpg', 'https://www.youtube.com/embed/jUwTY1m4_yw?hd=1', 'Ước Hẹn Mùa Thu là hành trình đi tìm lại mối tình đầu sau 15 năm hôn mê của chàng trai tên Duy mà trong đó 3 yếu tố: tình yêu, tình bạn & tình địch đan xen lẫn nhau tạo nên những màu sắc rất đặc biệt. Và đó cũng chính là lời ước hẹn của tuổi trẻ mà họ - những chàng trai, cô gái đã kịp tìm lại được trước khi để những lo toan bộn bề của cuộc sống cuốn trôi đi...', '2019-05-09 17:00:00.000000', 111, 0, '2019-06-17 08:46:33.556000', '2019-06-17 08:46:33.556000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (54, 'Xóm Trọ 3D: Cung Tâm Kế', 'https://i.moveek.com/media/resized/short/5c46e9ecc1701746300805.jpg', 'https://www.youtube.com/embed/aGSSxhDHjBY?hd=1', 'Chuyện phim xảy ra tại phủ Bảo Quan. Bảo Quan có 3 người vợ tên là: La Phu Nhân, Quý Phu Nhân và Y Lan Phu Nhân. Ở chung một phủ, chuyện tranh giành sự yêu thương giữa các phu nhân với nhau là chuyện rất dễ xảy ra. Mỗi ngày, các phu nhân luôn bày mưu tính kế để hãm hại nhau dẫn đến những tình huống dở khóc dở cười. Một ngày kia, Bạch Hạc, thái giám tổng quản vô tình biết được sự thật về Bảo Quan đại nhân: Bảo Quan luôn muốn được làm con gái và đã yêu thầm thị vệ Lý Tài. Vì ghen tức với Bảo Quan mà Bạch Hạc đã bày mưu tính kế nhằm lật đổ ngôi vị. Từ đó, mọi tranh chấp và toan tính bắt đầu...', '2019-02-11 17:00:00.000000', 85, 0, '2019-06-17 08:46:34.792000', '2019-06-17 08:46:34.792000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (56, 'Nữ Thần Rắn 2', 'https://i.moveek.com/media/resized/short/5c511d2c1af4b901031162.jpeg', 'https://www.youtube.com/embed/MfadMm5FPVc?hd=1', 'Soi, cô gái trẻ sinh ra và lớn lên ở một ngôi làng phía Bắc của Thái Lan. Cô dành cả thanh xuân để coi sóc đền thờ nữ thần Nakee nhằm tỏ lòng tôn kính. Nhưng những vụ án chết người kì lạ liên tiếp xảy ra khiến dân làng cho rằng đấy là điềm báo sự trở lại của Nữ Thần Rắn. Đồng thời coi Soi chính là hiện thân của Nữ thần rắn đang quay về báo thù. Soi sẽ phải làm cách nào với những điềm báo này.', '2019-02-07 17:00:00.000000', 93, 0, '2019-06-17 08:46:34.934000', '2019-06-17 08:46:34.934000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (59, 'Đại Ca Hóa Soái Ca', 'https://i.moveek.com/media/resized/short/5c243e805738d214851965.jpg', 'https://www.youtube.com/embed/ae7aRfw9224?hd=1', 'Sau một tai nạn bất ngờ, linh hồn của ông chú trung niên Pan-soo (tay xã hội đen máu mặt) tỉnh lại trong thân hình của Dong-hyun (cậu học sinh trung học). Với thân phận mới, Pan-soo đã quyết định tìm hiểu nguyên nhân của vụ tráo đổi kỳ lạ này, bắt đầu từ vụ tai nạn khiến Dong-hyun rơi từ trên tầng cao xuống.', '2019-01-17 17:00:00.000000', 125, 0, '2019-06-17 08:46:35.362000', '2019-06-17 08:46:35.362000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (61, 'Thằng Em Lý Tưởng', 'https://i.moveek.com/media/resized/short/5cb5c3eda7097767815867.png', '', 'Bộ phim tâm lý, hài hước và tình cảm đặc biệt là tình anh em vô cùng gắn kết của Se Ha và Dong-gu. Cả hai đều mang trong người những khuyết điểm khiến họ không thể sống một cuộc đời bình thường. Kẻ mất mẹ, người bị bỏ rơi, cả hai nương tựa nhau trong suốt hơn 20 năm gặp gỡ. Cho đến ngày họ gặp được Mi-hyun, cuộc sống của cả ba đã dần thay đổi khi Se Ha và Dong-gu buộc phải chia xa.', '2019-05-09 17:00:00.000000', 115, 0, '2019-06-17 08:46:36.134000', '2019-06-17 08:46:36.134000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (63, 'Lật Mặt 4: Nhà Có Khách', 'https://i.moveek.com/media/resized/short/5c873c8c28b77413900240.jpg', 'https://www.youtube.com/embed/eIKjGhRYS0M?hd=1', 'Một lần Vy cùng Huân và nhóm bạn thân gồm Thông, Phương, Bình  quyết định làm 1 chuyến trở về thăm mẹ và em trai. Tuy nhiên, trong thời gian thăm nhà, lần lượt từng người đều gặp những chuyện rất kỳ bí lạ lùng. Tất cả những người xung quanh đều ám chỉ nhà Vy có ma nhưng không ai dám nói ra và chỉ dám dùng từ KHÁCH theo thông lệ dân địa phương ở đây. Sự việc càng diễn tiến đáng sợ hơn khiến cơn tò mò lên đến đỉnh điểm, cả nhóm quyết định tìm cho ra sự thật.', '2019-04-11 17:00:00.000000', 100, 0, '2019-06-17 08:46:36.817000', '2019-06-17 08:46:36.817000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (66, 'Chị Chị Em Em', 'https://i.moveek.com/media/resized/short/5cb7e8e8d036e386530936.jpg', '', 'Chị Chị Em Em gợi liên tưởng về cuộc đấu trí so kè vô cùng hấp dẫn, ẩn giấu “cả một trời drama” giữa những người đẹp tưởng chừng thân thiết như chị em, nhưng lại dùng những thủ đoạn mưu mô, xảo quyệt nhất để đấu đá nhau.', '2019-12-19 17:00:00.000000', 0, 0, '2019-06-17 08:46:37.091000', '2019-06-17 08:46:37.091000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (34, 'Krasue: Nụ Hôn Ma Quái', 'https://i.moveek.com/media/resized/short/5ce6077f94eca075109887.jpg', 'https://www.youtube.com/embed/v91qtdnTvzI?hd=1', 'Ở một ngôi làng xa, cô gái trẻ Sai mắc lời nguyền của Krasue. Hàng đêm, đầu cô tách rời thân thể để săn lùng thú vật. Dân làng sợ hãi khi gia súc của mình chết hàng loạt và bắt đầu lùng bắt Krasue. Tuy nhiên, Noi - người bạn thân của Sai - vẫn sát cánh cùng cô bất chấp biết sự thật.', '2019-05-30 17:00:00.000000', 121, 0, '2019-06-17 08:46:31.706000', '2019-06-17 08:46:31.706000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (37, 'Võ Lâm Quái Thú', 'https://i.moveek.com/media/resized/short/5c19e1119d513325756076.jpg', 'https://www.youtube.com/embed/j-f3R8hRS10?hd=1', 'Trong cuộc chiến săn bắt quái thú, Tôn Ngọc Hạc chạm trán nhóm hảo hán chuyên cướp bạc của quan chia cho dân nghèo gồm Chân Kiếm, Hùng Kiều Kiều và Lãnh Băng Băng. Thế nhưng, số bạc chưa bị cướp bỗng không cánh mà bay khiến triều đình phong tỏa khắp nơi để truy bắt. Trong mối nguy trăm bề, nhóm nghĩa hiệp không hề hay biết rằng mình cũng đang bị săn lùng bởi một loài quái thú khát máu trong truyền thuyết.', '2019-01-03 17:00:00.000000', 0, 0, '2019-06-17 08:46:31.827000', '2019-06-17 08:46:31.827000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (40, 'Bộ Ba Quái Nhân', 'https://i.moveek.com/media/resized/short/5c1a0f91ef48c485753056.JPG', 'https://www.youtube.com/embed/LWNKskCsMZA?hd=1', 'Cuộc đụng độ của ba quái nhân. David Dunn - một người đàn ông bình thường sở hữu sức mạnh siêu phàm; "Quý ngài Glass" Elijah. "Bộ Ba Quái Nhân" và Kevin Wendell Crumb - một quái nhân với 24 tính cách tồn tại trong cùng một cơ thể.', '2019-01-17 17:00:00.000000', 129, 0, '2019-06-17 08:46:32.347000', '2019-06-17 08:46:32.347000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (43, 'Linh Hồn Tạm Trú', 'https://i.moveek.com/media/resized/short/5c00b4687c356967783364.jpg', 'https://www.youtube.com/embed/-Vh1Bni33V8?hd=1', 'Một linh hồn trú ngụ trong thân xác của Min, chàng nam sinh vừa mới tự sát. Linh hồn này được trao cơ hội tái sinh, với điều kiện trong 100 ngày, anh phải tìm ra nguyên nhân dẫn đến cái chết thảm thương của Min. Nếu không thể hoàn thành, linh hồn của anh sẽ vĩnh viễn không thể siêu thoát. Trong thân xác tạm thời, anh bắt đầu một cuộc sống mới và khai quật những bí mật cũ đang bị chôn vùi.', '2019-01-10 17:00:00.000000', 136, 0, '2019-06-17 08:46:32.662000', '2019-06-17 08:46:32.662000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (46, 'Người Vợ Ma', 'https://i.moveek.com/media/resized/short/5c3d8e5226652041298733.jpg', 'https://www.youtube.com/embed/Dqw5UMZpdd0?hd=1', 'Nard và Mac là một cặp đôi trong trường trung học. Trong một lần quá trớn, Nard vô tình mang thai và từ đây, tình cảm của đôi trẻ bắt đầu gặp nhiều biến cố. Mẹ của Mac bắt cả hai phải chấm dứt ngay mối quan hệ và tìm mọi cách đưa Mac ra nước ngoài du học. Trong khi đó mẹ của Nard thì thuyết phục cô bỏ đứa bé trong bụng. Nhưng điều tồi tệ đã xảy ra, Nard và con cô đều chết trên bàn phẫu thuật. Vì quá phẫn uất hồn ma của Nard không siêu thoát mà luẩn quẩn ở dương thế với hi vọng một ngày Mac trở về và tìm mẹ con cô.', '2019-01-17 17:00:00.000000', 99, 0, '2019-06-17 08:46:32.876000', '2019-06-17 08:46:32.876000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (47, 'Trạng Quỳnh', 'https://i.moveek.com/media/resized/short/5c1c55d7736df628153294.jpg', 'https://www.youtube.com/embed/2jvNTypICvA?hd=1', 'Trạng Quỳnh sẽ xoay quanh hành trình giải cứu thầy Đoàn, đồng thời là cha Điềm đầy gian truân nhưng cũng nhiều tiếng cười của những con người nhỏ bé trong xã hội phong kiến dù luôn bị chèn ép bởi tầng lớp quan lại bất công.', '2019-02-04 17:00:00.000000', 95, 0, '2019-06-17 08:46:33.443000', '2019-06-17 08:46:33.443000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (50, 'Cuộc Gọi Định Mệnh', 'https://i.moveek.com/media/resized/short/5c6977ef3aa40148212995.jpg', 'https://www.youtube.com/embed/_gVj4Zk_cVc?hd=1', 'Hiền, một cô gái bị bạn trai sắp cưới lừa gạt tình cảm. Cô thất vọng, lao vào tìm kiếm một mối quan hệ mới và làm quen với một chàng trai qua điện thoại. Ngẫu nhiên, anh là giám đốc khó tính ở công ty cô mới vào làm. Cả hai ít cơ hội tiếp xúc nên không nhận ra giọng nhau. Tình cảm nảy sinh sau những cuộc gọi tâm sự, họ quyết định gặp nhau.', '2019-02-28 17:00:00.000000', 93, 0, '2019-06-17 08:46:33.939000', '2019-06-17 08:46:33.939000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (52, 'Sát Thủ John Wick 3: Chuẩn Bị Chiến Tranh', 'https://i.moveek.com/media/cache/poster_small/media/80d28d67b67ed5f5616446d5f5997effc060ba52.jpg', 'https://www.youtube.com/embed/KBo2FboQ60U?hd=1', 'John Wick đang bị săn đuổi bởi một Hợp đồng Mở với giá trị tiền thưởng $14 triệu cho mạng sống của mình khắp thế giới, và bởi vì đã phá luật chơi: giết người ngay trong lãnh địa của Continental Hotel.', '2019-05-16 17:00:00.000000', 127, 0, '2019-06-17 08:46:34.235000', '2019-06-17 08:46:34.235000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (53, 'Trạng Quỳnh', 'https://i.moveek.com/media/resized/short/5c1c55d7736df628153294.jpg', 'https://www.youtube.com/embed/2jvNTypICvA?hd=1', 'Trạng Quỳnh sẽ xoay quanh hành trình giải cứu thầy Đoàn, đồng thời là cha Điềm đầy gian truân nhưng cũng nhiều tiếng cười của những con người nhỏ bé trong xã hội phong kiến dù luôn bị chèn ép bởi tầng lớp quan lại bất công.', '2019-02-04 17:00:00.000000', 95, 0, '2019-06-17 08:46:34.777000', '2019-06-17 08:46:34.777000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (57, 'Chị Trợ Lý Của Anh', 'https://i.moveek.com/media/resized/short/5c1a4cba08d1d269919956.jpg', 'https://www.youtube.com/embed/hgtxWxP5uBM?hd=1', 'Một nữ doanh nhân xinh đẹp, tài năng, đam mê công việc và đầy tham vọng; vì muốn cứu doanh nghiệp của gia đình thoát khỏi âm mưu thâu tóm của các cổ đông, cô phải chấp nhận một điều kiện là đang từ vị trí Phó tổng giám đốc một công ty Sữa chuyển sang làm Trợ lý cho một anh chàng thiếu gia “playboy” trẻ tuổi hơn – là Giám đốc một công ty Cà Phê cùng với nhiệm vụ phải tìm cho anh ta một cô bạn gái.', '2019-01-03 17:00:00.000000', 110, 0, '2019-06-17 08:46:34.947000', '2019-06-17 08:46:34.947000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (60, 'Aladdin', 'https://i.moveek.com/media/resized/short/5cd505413a53a218776025.jpg', 'https://www.youtube.com/embed/aAxfky411DA?hd=1', 'Kinh thành Agrabah phồn hoa, rực rỡ giữa lòng sa mạc, nơi luôn có những cuộc náo loạn do chàng thanh niên Aladdin tạo ra. Sinh ra và lớn lên tại khu ổ chuột cùng chú khỉ cưng Abu, Aladdin, nắm rõ từng ngóc ngách của thành phố nên anh có thể dễ dàng qua mặt bọn binh lính hoàng gia..', '2019-05-23 17:00:00.000000', 128, 0, '2019-06-17 08:46:35.377000', '2019-06-17 08:46:35.377000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (64, '7 Thi Thể', 'https://i.moveek.com/media/resized/short/5c1344a820ae2643570390.jpg', 'https://www.youtube.com/embed/58pynYbZjuM?hd=1', 'Dựa tên một sự kiện chấn động có thật từng xảy ra tại Busan, nơi những tội ác đã bị vùi lấp, thi thể nạn nhân không được tìm thấy và các cuộc điều tra không được diễn ra.', '2019-01-03 17:00:00.000000', 110, 0, '2019-06-17 08:46:36.954000', '2019-06-17 08:46:36.954000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (68, 'Người Hỏa Tiễn', 'https://i.moveek.com/media/resized/short/5ce625f976e52241524173.jpg', 'https://www.youtube.com/embed/H744TrEfF0A?hd=1', 'Người Hỏa Tiễn là câu chuyện về con đường âm nhạc từ thuở ấu thơ đến đỉnh cao danh vọng đầy cuồng nhiệt và vô vàn thăng trầm của Elton John – một trong những tượng đài bất hủ của nền làng nhạc thế giới.', '2019-06-13 17:00:00.000000', 121, 0, '2019-06-17 08:46:37.234000', '2019-06-17 08:46:37.234000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (45, 'Đường Về Nhà Của Cún Con', 'https://i.moveek.com/media/resized/short/5c2f22334dbd0839620797.jpg', 'https://www.youtube.com/embed/XwA4a3oqEGg?hd=1', 'Trong một lần mải mê đuổi sóc, Bella đi lạc rất xa khỏi căn nhà của mình. Cô nàng được một gia đình tìm thấy và đưa về nơi ở mới. Nhưng những thứ lạ lẫm kia chẳng hề có hình bóng quen thuộc của Lucas. Sợ rằng cậu chủ đang đợi chờ mình trong cô đơn, nàng cún bất chấp mọi rủi ro để tự tìm đường về nhà và chuẩn bị đối mặt với bao gian khó trước mắt', '2019-01-10 17:00:00.000000', 95, 0, '2019-06-17 08:46:32.712000', '2019-06-17 08:46:32.712000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (49, 'Cha Ma', 'https://i.moveek.com/media/cache/poster_small/media/5cff66fec5035312600483.jpg', '', 'Cha Ma kể về cô sinh viên trẻ đẹp tên Nhi sau khi nhận lời làm bảo mẫu cho gia đình một người mẹ đơn thân tên Thanh. Vì công việc bận rộn, Thanh liên tục phải vắng nhà và nhờ Nhi ở lại một mình chăm sóc bé Kitty vừa tròn 4 tuổi suốt cả ngày lẫn đêm.', '2019-08-22 17:00:00.000000', 0, 0, '2019-06-17 08:46:33.912000', '2019-06-17 08:46:33.912000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (51, 'Linh Hồn Tạm Trú', 'https://i.moveek.com/media/resized/short/5c00b4687c356967783364.jpg', 'https://www.youtube.com/embed/-Vh1Bni33V8?hd=1', 'Một linh hồn trú ngụ trong thân xác của Min, chàng nam sinh vừa mới tự sát. Linh hồn này được trao cơ hội tái sinh, với điều kiện trong 100 ngày, anh phải tìm ra nguyên nhân dẫn đến cái chết thảm thương của Min. Nếu không thể hoàn thành, linh hồn của anh sẽ vĩnh viễn không thể siêu thoát. Trong thân xác tạm thời, anh bắt đầu một cuộc sống mới và khai quật những bí mật cũ đang bị chôn vùi.', '2019-01-10 17:00:00.000000', 136, 0, '2019-06-17 08:46:34.177000', '2019-06-17 08:46:34.177000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (55, 'Xóm Trọ 3D: Cung Tâm Kế', 'https://i.moveek.com/media/resized/short/5c46e9ecc1701746300805.jpg', 'https://www.youtube.com/embed/aGSSxhDHjBY?hd=1', 'Chuyện phim xảy ra tại phủ Bảo Quan. Bảo Quan có 3 người vợ tên là: La Phu Nhân, Quý Phu Nhân và Y Lan Phu Nhân. Ở chung một phủ, chuyện tranh giành sự yêu thương giữa các phu nhân với nhau là chuyện rất dễ xảy ra. Mỗi ngày, các phu nhân luôn bày mưu tính kế để hãm hại nhau dẫn đến những tình huống dở khóc dở cười. Một ngày kia, Bạch Hạc, thái giám tổng quản vô tình biết được sự thật về Bảo Quan đại nhân: Bảo Quan luôn muốn được làm con gái và đã yêu thầm thị vệ Lý Tài. Vì ghen tức với Bảo Quan mà Bạch Hạc đã bày mưu tính kế nhằm lật đổ ngôi vị. Từ đó, mọi tranh chấp và toan tính bắt đầu...', '2019-02-11 17:00:00.000000', 85, 0, '2019-06-17 08:46:34.842000', '2019-06-17 08:46:34.842000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (58, 'Công Viên Kỳ Diệu', 'https://i.moveek.com/media/resized/short/5c511b2b824bc910948654.jpeg', 'https://www.youtube.com/embed/Ta8j1T3oBBo?hd=1', 'Công Viên Kỳ Diệu kể về cô bé June, người luôn mang trong mình những ý tưởng sáng tạo ngây ngô và thơ mộng nhất mà trẻ em có được. June sẽ vẽ lên công viên kỳ diệu với tên Wonderland của riêng mình và điều bất ngờ đã xảy ra, công viên trong tưởng tượng của cô bé hoàn toàn có thật.', '2019-03-14 17:00:00.000000', 85, 0, '2019-06-17 08:46:35.114000', '2019-06-17 08:46:35.114000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (62, 'Học Viện Siêu Anh Hùng: 2 Người Hùng', 'https://i.moveek.com/media/resized/short/5c3c89e5c8592701465362.jpg', 'https://www.youtube.com/embed/nIR34-kYU6w?hd=1', 'Cuộc hành trình cậu bé Izuku sau học kỳ siêu anh hùng đầu tiên, cũng như sau khi trải qua những lần đối đầu với kẻ thù lớn nhất của thế giới là “All For One” - kẻ mang sức mạnh chiếm đoạt các dị năng khác. Mang nặng mối lo nhưng Izuku sẽ được thư giãn vui chơi tại hòn đảo của những nhà khoa học lừng danh và biết thêm về quá khứ của All Might. Tuy nhiên không vì lẽ đó mà cái ác chịu đứng yên khi những thế lực xấu tiếp tục lên kế hoạch tấn công vào hòn đảo kiên cố nhất thế giới này.', '2019-01-24 17:00:00.000000', 95, 0, '2019-06-17 08:46:36.326000', '2019-06-17 08:46:36.326000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (65, 'Nàng Dâu Bị Nguyền', 'https://i.moveek.com/media/resized/short/5c372c6a348ce357740833.jpg', 'https://www.youtube.com/embed/quX6dz7wC1Q?hd=1', 'Bi kịch của gia tộc họ Lee - gia tộc có ba cậu con trai nhưng tất cả đều chết một cách bí ẩn vào đúng đêm tân hôn.', '2019-01-24 17:00:00.000000', 91, 0, '2019-06-17 08:46:36.967000', '2019-06-17 08:46:36.967000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (67, 'Cha Ma', 'https://i.moveek.com/media/cache/poster_small/media/5cff66fec5035312600483.jpg', '', 'Cha Ma kể về cô sinh viên trẻ đẹp tên Nhi sau khi nhận lời làm bảo mẫu cho gia đình một người mẹ đơn thân tên Thanh. Vì công việc bận rộn, Thanh liên tục phải vắng nhà và nhờ Nhi ở lại một mình chăm sóc bé Kitty vừa tròn 4 tuổi suốt cả ngày lẫn đêm.', '2019-08-22 17:00:00.000000', 0, 0, '2019-06-17 08:46:37.124000', '2019-06-17 08:46:37.124000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (69, 'Phi Vụ Nữ Quyền', 'https://i.moveek.com/media/resized/short/5cf898bb3e76d214208138.jpg', 'https://www.youtube.com/embed/rloncgRacm4?hd=1', 'Phi Vụ Nữ Quyền xoay quanh 2 nữ cảnh sát cùng bắt tay điều tra một vụ án đặc biệt nghiêm trọng, đây cũng là vấn đề mang tính thời sự thu hút sự quan tâm của cộng đồng hiện nay: tội phạm chuốc thuốc và hiếp dâm các cô gái trẻ, sau đó đe dọa phát tán clip “nóng” trên mạng xã hội. Mi-young – một điều tra viên kỳ cựu với thành tích lẫy lừng trong quá khứ, nay chịu số phận… ngồi bàn giấy ngày ngày tiếp nhận các khiếu nại dân sự. Ji-hye – một cảnh sát trẻ cứng đầu, bị phạt chuyển đến phòng khiếu nại dân sự Mi-young đang làm việc để rèn kỷ luật!', '2019-06-06 17:00:00.000000', 107, 0, '2019-06-17 08:46:37.276000', '2019-06-17 08:46:37.276000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (72, 'Phim Lego 2', 'https://i.moveek.com/media/resized/short/5c3eb4d936761951561359.jpg', 'https://www.youtube.com/embed/MHKnOsiX4ho?hd=1', 'Sau khi thế giới Legoverse bị Lego Duplo – nhóm sinh vật ngoài hành tinh mưu đồ phá hủy mọi cấu trúc Lego mà chúng bắt gặp, cuộc sống của người dân trở nên khó khăn và điêu đứng trừ Emmet. Anh chàng vẫn luôn lạc quan, yêu đời và chẳng hề lo ngại gì đến cuộc sống khó khăn ngoài kia.', '2019-02-07 17:00:00.000000', 106, 0, '2019-06-17 08:46:37.683000', '2019-06-17 08:46:37.683000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (73, 'Tình Đầu Thơ Ngây', 'https://i.moveek.com/media/resized/short/5c2db7eec423c880285153.png', 'https://www.youtube.com/embed/Wgl5V_0TFQo?hd=1', 'Vào một ngày đẹp trời, cuộc sống của bạn bỗng trở nên hỗn độn với sự xuất hiện của một cô bé lớp dưới, lẽo đẽo đi theo mình cả ngày, không những vậy còn… dọn luôn về nhà mình ở.', '2019-02-13 17:00:00.000000', 85, 0, '2019-06-17 08:46:37.768000', '2019-06-17 08:46:37.768000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (77, 'Vợ Ba', 'https://i.moveek.com/media/resized/short/5cd4fa3061c2d564819106.jpg', 'https://www.youtube.com/embed/DnbcEknOYBw?hd=1', 'Vợ Ba lấy bối cảnh vùng thôn quê Việt Nam cuối thế kỷ 19. Phim xoay quanh câu chuyện về cô gái tên Mây được gả làm vợ ba cho một gia đình giàu có. Tưởng như bắt đầu một cuộc sống sung túc, đầy đủ, cô gái trẻ không ngờ mình bị lôi vào một cuộc tranh đấu ngầm trong gia đình mới với vợ cả và vợ hai để có được vị trí quan trọng ở nhà chồng.', '2019-05-16 17:00:00.000000', 94, 0, '2019-06-17 08:46:38.075000', '2019-06-17 08:46:38.075000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (70, 'Vu Quy Đại Náo', 'https://i.moveek.com/media/resized/short/5c46a63ac3178577591914.jpg', 'https://www.youtube.com/embed/Fptn6pXAZRI?hd=1', 'Vu Quy Đại Náo kể về bộ ba bạn thân Trang, Hiền và Hoàng là những người trẻ có tâm hồn tự do yêu đương, coi “ế là xu thế” nhưng đang phải đối mặt với sức ép kết hôn từ phía gia đình: ông nội, dì và anh chị - đại diện cho thế hệ phụ huynh chẳng mong gì ngoài việc con em mình sớm yên bề gia thất. Tư tưởng mâu thuẫn đó trong cả 3 gia đình là một thực tế không ít bi hài.', '2019-02-21 17:00:00.000000', 110, 0, '2019-06-17 08:46:37.400000', '2019-06-17 08:46:37.400000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (75, 'Krasue: Nụ Hôn Ma Quái', 'https://i.moveek.com/media/resized/short/5ce6077f94eca075109887.jpg', 'https://www.youtube.com/embed/v91qtdnTvzI?hd=1', 'Ở một ngôi làng xa, cô gái trẻ Sai mắc lời nguyền của Krasue. Hàng đêm, đầu cô tách rời thân thể để săn lùng thú vật. Dân làng sợ hãi khi gia súc của mình chết hàng loạt và bắt đầu lùng bắt Krasue. Tuy nhiên, Noi - người bạn thân của Sai - vẫn sát cánh cùng cô bất chấp biết sự thật.', '2019-05-30 17:00:00.000000', 121, 0, '2019-06-17 08:46:37.895000', '2019-06-17 08:46:37.895000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (80, 'Cà Chớn, Anh Đừng Đi', 'https://i.moveek.com/media/resized/short/5c81d94da4632057901947.jpg', 'https://www.youtube.com/embed/5xDAvoHIFus?hd=1', 'Vốn theo học ngành sáng tác nhạc, Tuệ Nhi đang rất đau đầu vì chưa tìm được lời hát tâm đắc cho ca khúc mà mình chấp bút. Vào ngày nọ, vận mệnh xui khiến cô gặp gỡ Hải Sơn, gã họa sĩ lang bạt chuyên vẽ tranh chân dung. Ấn tượng trước khả năng thi phú dạt dào ở chàng thanh niên, Nghi liền mạnh dạn nhờ Sơn viết lời giúp mình. Trải qua hàng loạt tình huống dở khóc dở cười, cả hai chợt nhận ra mình đã có tình cảm với đối phương lúc nào chẳng hay.', '2019-05-16 17:00:00.000000', 90, 0, '2019-06-17 08:46:38.267000', '2019-06-17 08:46:38.267000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (84, 'Vô Gian Đạo', 'https://i.moveek.com/media/resized/short/5cc8ffce0c4f7731718778.jpg', 'https://www.youtube.com/embed/foGeq3pCT88?hd=1', 'Vô Gian Đạo khai thác câu chuyện phức tạp trong thế giới đầy lọc lừa của những tay bịp thông qua mối quan hệ giữa Cháy, Đạo, Thạch và Tâm. Cháy là anh chàng giỏi bài bạc bịp và mê gái. Trong dịp tình cờ, Cháy phải lòng Linh – cô nàng xinh đẹp nhưng lại bị mù đôi mắt. Vẻ đẹp trong trẻo của Linh đã khiến Cháy rung động và phải trổ hết tài chinh phục.', '2019-05-23 17:00:00.000000', 113, 0, '2019-06-17 08:46:38.730000', '2019-06-17 08:46:38.730000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (88, 'Tử Địa Báo Thù', 'https://i.moveek.com/media/resized/short/5c3f4bab3c851474637394.jpg', 'https://www.youtube.com/embed/NmaMdOtHBbo?hd=1', 'Sát thủ khét tiếng Roy Cady được chẩn đoán bị ung thư phổi ở tuổi 40 và không thể tiếp tục công việc của mình. Trước khi ung thư có thể giết chết Roy thì các ông chủ của Roy muốn thủ tiêu anh trước vì anh nắm quá nhiều thông tin mật của tổ chức.', '2019-01-17 17:00:00.000000', 94, 0, '2019-06-17 08:46:39.127000', '2019-06-17 08:46:39.127000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (91, 'Chị Chị Em Em', 'https://i.moveek.com/media/resized/short/5cb7e8e8d036e386530936.jpg', '', 'Chị Chị Em Em gợi liên tưởng về cuộc đấu trí so kè vô cùng hấp dẫn, ẩn giấu “cả một trời drama” giữa những người đẹp tưởng chừng thân thiết như chị em, nhưng lại dùng những thủ đoạn mưu mô, xảo quyệt nhất để đấu đá nhau.', '2019-12-19 17:00:00.000000', 0, 0, '2019-06-17 08:46:39.503000', '2019-06-17 08:46:39.503000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (95, 'Người Quen Xa Lạ', 'https://i.moveek.com/media/resized/short/5c1b1a0781357629317812.jpg', 'https://www.youtube.com/embed/7KlMKzyWNz0?hd=1', 'Một nhóm bạn thân thiết với nhau đã 30 năm. Một đêm nọ, họ tụ họp tại một buổi tiệc tân gia ấm cúng và cùng tán gẫu. Những câu chuyện phiếm, những kỉ niệm năm xưa ùa về khiến họ vô cùng vui vẻ. Trong không khí phấn khích đó, một người trong nhóm đã đề nghị các “tri kỉ” hãy đặt điện thoại lên bàn để bất kì cuộc điện thoại, tin nhắn nào đổ chuông tới cũng phải chia sẻ cùng nhau.', '2019-01-03 17:00:00.000000', 115, 0, '2019-06-17 08:46:39.619000', '2019-06-17 08:46:39.619000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (99, 'Thằng Em Lý Tưởng', 'https://i.moveek.com/media/resized/short/5cb5c3eda7097767815867.png', '', 'Bộ phim tâm lý, hài hước và tình cảm đặc biệt là tình anh em vô cùng gắn kết của Se Ha và Dong-gu. Cả hai đều mang trong người những khuyết điểm khiến họ không thể sống một cuộc đời bình thường. Kẻ mất mẹ, người bị bỏ rơi, cả hai nương tựa nhau trong suốt hơn 20 năm gặp gỡ. Cho đến ngày họ gặp được Mi-hyun, cuộc sống của cả ba đã dần thay đổi khi Se Ha và Dong-gu buộc phải chia xa.', '2019-05-09 17:00:00.000000', 115, 0, '2019-06-17 08:46:40.846000', '2019-06-17 08:46:40.846000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (106, 'Anh Thầy Ngôi Sao', 'https://i.moveek.com/bundles/ornweb/img/no-poster.png?v=8048', '', 'Anh Thầy Ngôi Sao xoay quanh Hoàng – một chàng trai trẻ khao khát trở thành ca sĩ nổi tiếng, vì chưa gặp thời nên tạm kiếm sống bằng công việc làm thầy giáo dạy nhạc. Sau một biến cố, Hoàng buộc phải chuyển công tác ra đảo Quí – hòn đảo nhỏ biệt lập cách xa đất liền – và gặp không ít phiền toái khi tiếp quản một lớp học đặc biệt chỉ với vỏn vẹn 5 học trò. Nhiều lần bỏ về không thành vì đám nhỏ và người dân trên đảo luôn tìm mọi cách để giữ chân thầy giáo, Hoàng vừa miễn cưỡng chấp nhận cuộc sống mới, vừa tìm cơ hội thực hiện ước mơ của mình.', '2019-08-29 17:00:00.000000', 0, 0, '2019-06-17 08:46:43.434000', '2019-06-17 08:46:43.434000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (107, 'Nụ Hôn Đầu', 'https://i.moveek.com/media/resized/short/5c4e8b232f1d1147606888.jpg', 'https://www.youtube.com/embed/Z_dkrJaVE_k?hd=1', 'Nụ Hôn Đầu xoay quanh hai nhân vật chính là Giang Trực Thụ và Viên Tương Cầm. Trong khi Giang Trực Thụ là một chàng trai thư sinh toàn năng lạnh lùng hàng ngàn học sinh mến mộ thì Tương Cầm lại là một cô nàng hậu đậu, ngây thơ và đem lòng mơ mộng về người mà cô quyết định sẽ ảnh hưởng đến mình suốt cuộc đời. Từ lần đầu tiên gặp mặt, đến những cảm xúc lẫn lộn không thể diễn tả thành lời và cuối cùng là can đảm nói ra hết tình cảm của bản thân, hành trình tìm kiếm tình yêu đích thực của cả hai tràn ngập trong những giai thoại ngọt ngào và lãng mạn.', '2019-02-14 17:00:00.000000', 120, 0, '2019-06-17 08:46:44.263000', '2019-06-17 08:46:44.263000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (110, 'Ma Quái', 'https://i.moveek.com/media/resized/short/5c30cb73e46a9959316265.jpg', 'https://www.youtube.com/embed/Sm6ryOLZ_0s?hd=1', 'Bà đồng Helen đang huấn luyện cho hai cô gái trẻ khả năng giao tiếp với cõi âm. Trong quá trình truyền thụ, một thực thể bí ẩn đã được triệu hồi. Nó tặng cho 3 cô trò một thiết bị đặc biệt có thể thực hiện mọi ước muốn, nhưng đổi lại họ phải “trả giá” rất đắt. Liệu con quỷ hay lòng người đáng sợ hơn?', '2019-01-10 17:00:00.000000', 75, 0, '2019-06-17 08:46:46.003000', '2019-06-17 08:46:46.003000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (119, 'Trợ Lý Hết Ý', 'https://i.moveek.com/media/resized/short/5c369435bc740130272217.png', 'https://www.youtube.com/embed/2vBB2yXeh_8?hd=1', 'Phim kể về mối quan hệ có nhiều tình huống dở khóc dở cười giữa hai nhân vật: Một người đàn ông giàu có nhưng bị liệt tứ chi và một thanh niên thất nghiệp đang cố gắng sống tích cực, tốt đẹp hơn.', '2019-01-17 17:00:00.000000', 125, 0, '2019-06-17 08:46:49.011000', '2019-06-17 08:46:49.011000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (71, 'Doraemon: Nobita và Mặt Trăng Phiêu Lưu Ký', 'https://i.moveek.com/media/resized/short/5cca9b9047e54118071696.jpeg', 'https://www.youtube.com/embed/O61aTrlHJRA?hd=1', 'Dựa trên truyện cổ dân gian của người Nhật rằng trên cung trăng có loài thỏ sinh sống ở đó, phim lấy bối cảnh trên mặt trăng cùng nội dung nhấn mạnh vào tình bạn được liên kết mạnh mẽ bởi "sức mạnh của niềm tin". Nhân vật mới xuất hiện là Lunna- một cô gái bí ẩn sống ở mặt trăng, và cuộc hành trình đầy cam go và khó khăn của nhóm Nobita trên con đường khám phá mặt trăng cũng như chống lại ác nhân Diabolo cùng tên hầu cận gian manh Goddard.', '2019-05-23 17:00:00.000000', 120, 0, '2019-06-17 08:46:37.568000', '2019-06-17 08:46:37.568000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (74, 'Phi Vụ Nữ Quyền', 'https://i.moveek.com/media/resized/short/5cf898bb3e76d214208138.jpg', 'https://www.youtube.com/embed/rloncgRacm4?hd=1', 'Phi Vụ Nữ Quyền xoay quanh 2 nữ cảnh sát cùng bắt tay điều tra một vụ án đặc biệt nghiêm trọng, đây cũng là vấn đề mang tính thời sự thu hút sự quan tâm của cộng đồng hiện nay: tội phạm chuốc thuốc và hiếp dâm các cô gái trẻ, sau đó đe dọa phát tán clip “nóng” trên mạng xã hội. Mi-young – một điều tra viên kỳ cựu với thành tích lẫy lừng trong quá khứ, nay chịu số phận… ngồi bàn giấy ngày ngày tiếp nhận các khiếu nại dân sự. Ji-hye – một cảnh sát trẻ cứng đầu, bị phạt chuyển đến phòng khiếu nại dân sự Mi-young đang làm việc để rèn kỷ luật!', '2019-06-06 17:00:00.000000', 107, 0, '2019-06-17 08:46:37.799000', '2019-06-17 08:46:37.799000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (76, 'Cua Lại Vợ Bầu', 'https://i.moveek.com/media/resized/short/5c3d4dafd255d392786021.jpg', 'https://www.youtube.com/embed/vfQsaG5FkN4?hd=1', 'Chuyện tình của Trọng Thoại và Nhã Linh đang hoàn hảo cho đến khi người yêu cũ của Nhã Linh là Quý Khánh thình lình xuất hiện và gây nên hàng loạt xáo trộn trong trái tim cô gái.', '2019-02-04 17:00:00.000000', 102, 0, '2019-06-17 08:46:37.995000', '2019-06-17 08:46:37.995000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (78, 'Vợ Ba', 'https://i.moveek.com/media/resized/short/5cd4fa3061c2d564819106.jpg', 'https://www.youtube.com/embed/DnbcEknOYBw?hd=1', 'Vợ Ba lấy bối cảnh vùng thôn quê Việt Nam cuối thế kỷ 19. Phim xoay quanh câu chuyện về cô gái tên Mây được gả làm vợ ba cho một gia đình giàu có. Tưởng như bắt đầu một cuộc sống sung túc, đầy đủ, cô gái trẻ không ngờ mình bị lôi vào một cuộc tranh đấu ngầm trong gia đình mới với vợ cả và vợ hai để có được vị trí quan trọng ở nhà chồng.', '2019-05-16 17:00:00.000000', 94, 0, '2019-06-17 08:46:38.214000', '2019-06-17 08:46:38.214000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (86, 'Căn Phòng Tử Thần', 'https://i.moveek.com/media/resized/short/5c205b2461a7b469017087.jpg', 'https://www.youtube.com/embed/8kE8FmdZu7U?hd=1', 'Căn Phòng Tử Thần đưa 6 người chơi đến những căn phòng với những câu đó hóc búa nhất mà sự thất bại của người chơi sẽ được đánh đổi bằng mạng sống, làm con chuột bạch trong lồng mua vui cho những kẻ bệnh hoạn.', '2019-01-03 17:00:00.000000', 99, 0, '2019-06-17 08:46:38.827000', '2019-06-17 08:46:38.827000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (92, 'Yolo - Bạn Chỉ Sống Một Lần', 'https://i.moveek.com/media/resized/short/5c243886b220e679292558.jpg', 'https://www.youtube.com/embed/QvlVrFSP79I?hd=1', 'Những người trẻ dấn thân theo đuổi đam mê âm nhạc, đặc biệt là “thế giới ngầm” - underground. Để thỏa mãn đam mê ca hát với cá tính âm nhạc của riêng mình, họ phải trải qua nhiều sóng gió và nỗ lực không ngừng để khẳng định bản thân. Những cám dỗ, mảnh tối của giới giải trí cũng là những thách thức để người bạn trẻ này đối mặt và không vấp ngã.', '2019-01-10 17:00:00.000000', 111, 0, '2019-06-17 08:46:39.532000', '2019-06-17 08:46:39.532000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (96, 'Chị Mười Ba: Phần Kết Thập Tam Muội', 'https://i.moveek.com/media/resized/short/5c7e4ed28602c190722595.png', 'https://www.youtube.com/embed/MGSjjzMlWpc?hd=1', 'Dạo gần đây, phe Chợ Mới đang kháo nhau về sự xuất hiện của một tay giang hồ cộm cán bất hảo ở Chợ Cũ - Hắc Hổ. Thằng nào thằng nấy mặt mũi khả ố khó ưa cầm sẵn gậy gộc giáo mác chuẩn bị chiến đấu.', '2019-03-28 17:00:00.000000', 95, 0, '2019-06-17 08:46:39.747000', '2019-06-17 08:46:39.747000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (101, 'Giáp Thần Gundam: Ký Ức Chiến Binh', 'https://i.moveek.com/media/resized/short/5c618652da66e508111566.jpg', 'https://www.youtube.com/embed/jZYflDyRjzc?hd=1', 'Năm U.C.0096, sau sự kiện chấn động "Laplace Incident" dẫn đến sự suy tàn của đế chế Neo Zeon, 2 bộ giáp chiến hùng mạnh Unicorn Gundam và Banshee bị phong tỏa và cất giữ bởi Chính Quyền Liên Bang. Tuy nhiên năm U.C.0097, một bộ giáp Gundam thứ 3 bỗng nhiên xuất hiện mệnh danh là Phenex và trở thành mục tiêu đuổi bắt của cả hai thế lực là Chính Quyền Liên Ban và Neo-Zeon cùng với âm mưu che giấu tội ác phía sau những con người mang năng lực dự đoán tương lai Newtypes.', '2019-02-14 17:00:00.000000', 90, 0, '2019-06-17 08:46:41.231000', '2019-06-17 08:46:41.231000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (104, 'Đặc Vụ Áo Đen - Sứ Mệnh Toàn Cầu', 'https://i.moveek.com/media/resized/short/5cc16c751e29d954588711.jpg', 'https://www.youtube.com/embed/bQv_gWmeU7s?hd=1', 'Bấy lâu nay, Đặc vụ Áo Đen luôn là những người hùng thầm lặng “ngầu” nhất, bảo vệ Trái Đất khỏi những hiểm họa xấu xa ngoài hành tinh. Trong cuộc phiêu lưu mới này, họ phải đối mặt với mối đe dọa mang tính toàn cầu lớn nhất từ trước đến giờ: truy tìm điệp viên hai mang ẩn mình trong tổ chức Đặc vụ Áo Đen.', '2019-06-13 17:00:00.000000', 115, 0, '2019-06-17 08:46:41.930000', '2019-06-17 08:46:41.930000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (108, 'Chúa Tể Godzilla', 'https://i.moveek.com/media/resized/short/5cd44f6acfd41775732279.jpg', 'https://www.youtube.com/embed/HMXnrOd7e6E?hd=1', 'Chúa Tể Godzilla tập trung vào cuộc đụng độ các thành viên tổ chức Monarch với những quái thú khổng lồ - Rodan, Mothra, và King Ghidorah. Khi những quái vật huyền thoại trỗi dậy, chúng sẽ tranh giành quyền lực tối cao để thống trị thế giới. Do vậy, loài người sẽ phải đấu tranh để đem lại sự cân bằng trước những hiểm họa diệt vong đó.', '2019-05-30 17:00:00.000000', 131, 0, '2019-06-17 08:46:44.901000', '2019-06-17 08:46:44.901000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (114, 'Táo Quậy', 'https://i.moveek.com/media/resized/short/5c3c8b8b0c608537094463.jpg', 'https://www.youtube.com/embed/4pHGnN6Xq70?hd=1', 'Táo Quậy, vị thần cai quản bếp nhà Minh, một cậu thiếu gia ham chơi. Một tai nạn bất ngờ xảy ra làm cho cả hai dính vào nhau bằng một sợi dây phép thuật.', '2019-02-04 17:00:00.000000', 102, 0, '2019-06-17 08:46:46.787000', '2019-06-17 08:46:46.787000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (118, 'Phim Lego 2', 'https://i.moveek.com/media/resized/short/5c3eb4d936761951561359.jpg', 'https://www.youtube.com/embed/MHKnOsiX4ho?hd=1', 'Sau khi thế giới Legoverse bị Lego Duplo – nhóm sinh vật ngoài hành tinh mưu đồ phá hủy mọi cấu trúc Lego mà chúng bắt gặp, cuộc sống của người dân trở nên khó khăn và điêu đứng trừ Emmet. Anh chàng vẫn luôn lạc quan, yêu đời và chẳng hề lo ngại gì đến cuộc sống khó khăn ngoài kia.', '2019-02-07 17:00:00.000000', 106, 0, '2019-06-17 08:46:48.198000', '2019-06-17 08:46:48.198000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (79, 'Táo Quậy', 'https://i.moveek.com/media/resized/short/5c3c8b8b0c608537094463.jpg', 'https://www.youtube.com/embed/4pHGnN6Xq70?hd=1', 'Táo Quậy, vị thần cai quản bếp nhà Minh, một cậu thiếu gia ham chơi. Một tai nạn bất ngờ xảy ra làm cho cả hai dính vào nhau bằng một sợi dây phép thuật.', '2019-02-04 17:00:00.000000', 102, 0, '2019-06-17 08:46:38.243000', '2019-06-17 08:46:38.243000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (85, 'Avengers: Hồi Kết', 'https://i.moveek.com/media/resized/short/5ca2dd8c2d877417922349.jpg', 'https://www.youtube.com/embed/knZb5PJUSPQ?hd=1', 'Sau sự kiện hủy diệt tàn khốc, vũ trụ chìm trong cảnh hoang tàn. Với sự trợ giúp của những đồng minh còn sống sót, biệt đội siêu anh hùng Avengers tập hợp một lần nữa để đảo ngược hành động của Thanos và khôi phục lại trật tự của vũ trụ.', '2019-04-25 17:00:00.000000', 181, 0, '2019-06-17 08:46:38.756000', '2019-06-17 08:46:38.756000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (89, 'Võ Lâm Quái Thú', 'https://i.moveek.com/media/resized/short/5c19e1119d513325756076.jpg', 'https://www.youtube.com/embed/j-f3R8hRS10?hd=1', 'Trong cuộc chiến săn bắt quái thú, Tôn Ngọc Hạc chạm trán nhóm hảo hán chuyên cướp bạc của quan chia cho dân nghèo gồm Chân Kiếm, Hùng Kiều Kiều và Lãnh Băng Băng. Thế nhưng, số bạc chưa bị cướp bỗng không cánh mà bay khiến triều đình phong tỏa khắp nơi để truy bắt. Trong mối nguy trăm bề, nhóm nghĩa hiệp không hề hay biết rằng mình cũng đang bị săn lùng bởi một loài quái thú khát máu trong truyền thuyết.', '2019-01-03 17:00:00.000000', 0, 0, '2019-06-17 08:46:39.155000', '2019-06-17 08:46:39.155000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (94, 'Hạnh Phúc Của Mẹ', 'https://i.moveek.com/media/resized/short/5c6ead6f7f813086702778.jpg', 'https://www.youtube.com/embed/baUa_p2-wWQ?hd=1', 'Hạnh Phúc Của Mẹ kể về “cuộc chiến” giúp con trở thành một đứa trẻ bình thường của mẹ Tuệ - một người mẹ đơn thân và chân quê với cậu con trai mắc bệnh tự kỷ bẩm sinh. Như rất nhiều người mẹ ít kiến thức nhưng giàu tình yêu thương ở những
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (98, 'Bộ Ba Quái Nhân', 'https://i.moveek.com/media/resized/short/5c1a0f91ef48c485753056.JPG', 'https://www.youtube.com/embed/LWNKskCsMZA?hd=1', 'Cuộc đụng độ của ba quái nhân. David Dunn - một người đàn ông bình thường sở hữu sức mạnh siêu phàm; "Quý ngài Glass" Elijah. "Bộ Ba Quái Nhân" và Kevin Wendell Crumb - một quái nhân với 24 tính cách tồn tại trong cùng một cơ thể.', '2019-01-17 17:00:00.000000', 129, 0, '2019-06-17 08:46:40.666000', '2019-06-17 08:46:40.666000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (102, 'Chị Mười Ba: Phần Kết Thập Tam Muội', 'https://i.moveek.com/media/resized/short/5c7e4ed28602c190722595.png', 'https://www.youtube.com/embed/MGSjjzMlWpc?hd=1', 'Dạo gần đây, phe Chợ Mới đang kháo nhau về sự xuất hiện của một tay giang hồ cộm cán bất hảo ở Chợ Cũ - Hắc Hổ. Thằng nào thằng nấy mặt mũi khả ố khó ưa cầm sẵn gậy gộc giáo mác chuẩn bị chiến đấu.', '2019-03-28 17:00:00.000000', 95, 0, '2019-06-17 08:46:41.717000', '2019-06-17 08:46:41.717000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (105, 'Diệp Vấn Ngoại Truyện: Trương Thiên Chí', 'https://i.moveek.com/media/cache/poster_small/media/b4b7d50956c8a0a6c37a6607f77fa7b550498b0c.jpg', 'https://www.youtube.com/embed/bqyFZlw4KgQ?hd=1', 'Sau trận thua trước Diệp Vấn, Trương Thiên Chí quyết định sống ẩn danh cùng gia đình nhỏ của mình. Tuy nhiên, rắc rối bắt đầu ập tới, khiến Trương Thiên Chí phải bị lôi vào một cuộc đối đầu máu lửa với những kẻ thù đến từ ngoại quốc.', '2019-01-10 17:00:00.000000', 107, 0, '2019-06-17 08:46:42.116000', '2019-06-17 08:46:42.116000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (115, '7 Thi Thể', 'https://i.moveek.com/media/resized/short/5c1344a820ae2643570390.jpg', 'https://www.youtube.com/embed/58pynYbZjuM?hd=1', 'Dựa tên một sự kiện chấn động có thật từng xảy ra tại Busan, nơi những tội ác đã bị vùi lấp, thi thể nạn nhân không được tìm thấy và các cuộc điều tra không được diễn ra.', '2019-01-03 17:00:00.000000', 110, 0, '2019-06-17 08:46:47.031000', '2019-06-17 08:46:47.031000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (123, 'Đại Chiến Âm Dương', 'https://i.moveek.com/media/resized/short/5c3c894536034094889815.jpg', 'https://www.youtube.com/embed/jXtUrQ2cUb0?hd=1', 'Đại Chiến Âm Dương là câu chuyện về một thầy pháp kì bí - Bồ Tùng Linh với khả năng dùng bút vẽ để hàng phục yêu ma.', '2019-02-04 17:00:00.000000', 109, 0, '2019-06-17 08:46:50.278000', '2019-06-17 08:46:50.278000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (128, 'Chỉ Cần Em Hạnh Phúc', 'https://i.moveek.com/media/resized/short/5c2f762661fc5039338126.jpg', 'https://www.youtube.com/embed/SM87W3Ol3mA?hd=1', 'K và Cream gặp nhau năm 16 tuổi tại trường trung học và dần thân thiết như người trong gia đình. Năm tháng thôi qua, K đi làm cho một hãng thu âm và Cream trở thành nhạc sĩ, họ vẫn sống với nhau dù không phải là một đôi. Một ngày kia, K bị chẩn đoán mắc bệnh bạch cầu, K do dự không tiết lộ bệnh tình của mình cũng như thổ lộ tình yêu với Cream vì sợ cô tổn thương. Trước khi không còn thời gian, K phải làm mọi thứ để Cream có thể ổn định và hạnh phúc.', '2019-01-10 17:00:00.000000', 106, 0, '2019-06-17 08:46:53.956000', '2019-06-17 08:46:53.956000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (132, 'Đẳng Cấp Thú Cưng 2', 'https://i.moveek.com/media/resized/short/5c204620a84cb745296939.jpg', 'https://www.youtube.com/embed/5UgcBLRLfGs?hd=1', 'Cũng như bao thú cưng khác, khi đến phòng khám Max đã không giấu nổi vẻ âu lo trên khuôn mặt. Đã vậy, chú chó tội nghiệp còn gặp thêm nhiều người bạn đồng loại vô cùng bất bình thường. Đầu tiên là chú mèo xám thân thiện bắt chuyện với Max, trấn an cậu rằng bác sĩ thú y ở đây rất giỏi nhất ngành về chữa trị chứng… rối loạn cư xử. Và rồi thì chú mèo bắt đầu “nổi đóa” cào cấu chủ. Lần lượt sau đó Max được gặp chú chuột hamster xám điên cuồng “chạy bộ” giảm cân, một chú chó nâu luôn phân vân rằng liệu mình có đủ ngoan, lại còn cả một cặp mèo sinh đôi có nụ cười vô cùng quái dị. Tránh vỏ dưa lại gặp vỏ dừa, Max vốn đã âu lo lại càng trở nên sợ sệt hơn với cuộc thăm khám trước mắt.', '2019-06-06 17:00:00.000000', 86, 0, '2019-06-17 08:46:57.424000', '2019-06-17 08:46:57.424000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (135, 'Hai Phượng', 'https://i.moveek.com/media/resized/short/5c3d614e46d19408073352.jpg', 'https://www.youtube.com/embed/XUSjnQmuc-M?hd=1', 'Hai Phượng là hành trình nghẹt thở và căng thẳng của bà mẹ đơn thân Hai Phượng khi phải đối đầu với cả 1 đường dây tội phạm bắt cóc và buôn bán nội tạng xuyên quốc gia để cứu đứa con gái bé bỏng Mai. Để cứu được con, Hai Phượng chỉ có 14 tiếng đồng hồ,  bất kỳ một sơ xuất nhỏ nào cũng sẽ phải trả giá bằng chính mạng sống của chính cô và bé Mai.', '2019-02-21 17:00:00.000000', 100, 0, '2019-06-17 08:47:02.547000', '2019-06-17 08:47:02.547000');
