INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (83, 'Yolo - Bạn Chỉ Sống Một Lần', 'https://i.moveek.com/media/resized/short/5c243886b220e679292558.jpg', 'https://www.youtube.com/embed/QvlVrFSP79I?hd=1', 'Những người trẻ dấn thân theo đuổi đam mê âm nhạc, đặc biệt là “thế giới ngầm” - underground. Để thỏa mãn đam mê ca hát với cá tính âm nhạc của riêng mình, họ phải trải qua nhiều sóng gió và nỗ lực không ngừng để khẳng định bản thân. Những cám dỗ, mảnh tối của giới giải trí cũng là những thách thức để người bạn trẻ này đối mặt và không vấp ngã.', '2019-01-10 17:00:00.000000', 111, 0, '2019-06-17 08:46:38.674000', '2019-06-17 08:46:38.674000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (87, 'Anh Thầy Ngôi Sao', 'https://i.moveek.com/bundles/ornweb/img/no-poster.png?v=8048', '', 'Anh Thầy Ngôi Sao xoay quanh Hoàng – một chàng trai trẻ khao khát trở thành ca sĩ nổi tiếng, vì chưa gặp thời nên tạm kiếm sống bằng công việc làm thầy giáo dạy nhạc. Sau một biến cố, Hoàng buộc phải chuyển công tác ra đảo Quí – hòn đảo nhỏ biệt lập cách xa đất liền – và gặp không ít phiền toái khi tiếp quản một lớp học đặc biệt chỉ với vỏn vẹn 5 học trò. Nhiều lần bỏ về không thành vì đám nhỏ và người dân trên đảo luôn tìm mọi cách để giữ chân thầy giáo, Hoàng vừa miễn cưỡng chấp nhận cuộc sống mới, vừa tìm cơ hội thực hiện ước mơ của mình.', '2019-08-29 17:00:00.000000', 0, 0, '2019-06-17 08:46:38.937000', '2019-06-17 08:46:38.937000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (90, 'Trợ Lý Hết Ý', 'https://i.moveek.com/media/resized/short/5c369435bc740130272217.png', 'https://www.youtube.com/embed/2vBB2yXeh_8?hd=1', 'Phim kể về mối quan hệ có nhiều tình huống dở khóc dở cười giữa hai nhân vật: Một người đàn ông giàu có nhưng bị liệt tứ chi và một thanh niên thất nghiệp đang cố gắng sống tích cực, tốt đẹp hơn.', '2019-01-17 17:00:00.000000', 125, 0, '2019-06-17 08:46:39.219000', '2019-06-17 08:46:39.219000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (93, 'Yolo - Bạn Chỉ Sống Một Lần', 'https://i.moveek.com/media/resized/short/5c243886b220e679292558.jpg', 'https://www.youtube.com/embed/QvlVrFSP79I?hd=1', 'Những người trẻ dấn thân theo đuổi đam mê âm nhạc, đặc biệt là “thế giới ngầm” - underground. Để thỏa mãn đam mê ca hát với cá tính âm nhạc của riêng mình, họ phải trải qua nhiều sóng gió và nỗ lực không ngừng để khẳng định bản thân. Những cám dỗ, mảnh tối của giới giải trí cũng là những thách thức để người bạn trẻ này đối mặt và không vấp ngã.', '2019-01-10 17:00:00.000000', 111, 0, '2019-06-17 08:46:39.544000', '2019-06-17 08:46:39.544000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (97, 'Nụ Hôn Đầu', 'https://i.moveek.com/media/resized/short/5c4e8b232f1d1147606888.jpg', 'https://www.youtube.com/embed/Z_dkrJaVE_k?hd=1', 'Nụ Hôn Đầu xoay quanh hai nhân vật chính là Giang Trực Thụ và Viên Tương Cầm. Trong khi Giang Trực Thụ là một chàng trai thư sinh toàn năng lạnh lùng hàng ngàn học sinh mến mộ thì Tương Cầm lại là một cô nàng hậu đậu, ngây thơ và đem lòng mơ mộng về người mà cô quyết định sẽ ảnh hưởng đến mình suốt cuộc đời. Từ lần đầu tiên gặp mặt, đến những cảm xúc lẫn lộn không thể diễn tả thành lời và cuối cùng là can đảm nói ra hết tình cảm của bản thân, hành trình tìm kiếm tình yêu đích thực của cả hai tràn ngập trong những giai thoại ngọt ngào và lãng mạn.', '2019-02-14 17:00:00.000000', 120, 0, '2019-06-17 08:46:40.619000', '2019-06-17 08:46:40.619000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (100, 'Lật Mặt 4: Nhà Có Khách', 'https://i.moveek.com/media/resized/short/5c873c8c28b77413900240.jpg', 'https://www.youtube.com/embed/eIKjGhRYS0M?hd=1', 'Một lần Vy cùng Huân và nhóm bạn thân gồm Thông, Phương, Bình  quyết định làm 1 chuyến trở về thăm mẹ và em trai. Tuy nhiên, trong thời gian thăm nhà, lần lượt từng người đều gặp những chuyện rất kỳ bí lạ lùng. Tất cả những người xung quanh đều ám chỉ nhà Vy có ma nhưng không ai dám nói ra và chỉ dám dùng từ KHÁCH theo thông lệ dân địa phương ở đây. Sự việc càng diễn tiến đáng sợ hơn khiến cơn tò mò lên đến đỉnh điểm, cả nhóm quyết định tìm cho ra sự thật.', '2019-04-11 17:00:00.000000', 100, 0, '2019-06-17 08:46:41.150000', '2019-06-17 08:46:41.150000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (103, 'Căn Phòng Tử Thần', 'https://i.moveek.com/media/resized/short/5c205b2461a7b469017087.jpg', 'https://www.youtube.com/embed/8kE8FmdZu7U?hd=1', 'Căn Phòng Tử Thần đưa 6 người chơi đến những căn phòng với những câu đó hóc búa nhất mà sự thất bại của người chơi sẽ được đánh đổi bằng mạng sống, làm con chuột bạch trong lồng mua vui cho những kẻ bệnh hoạn.', '2019-01-03 17:00:00.000000', 99, 0, '2019-06-17 08:46:41.866000', '2019-06-17 08:46:41.866000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (109, 'Đại Ca Hóa Soái Ca', 'https://i.moveek.com/media/resized/short/5c243e805738d214851965.jpg', 'https://www.youtube.com/embed/ae7aRfw9224?hd=1', 'Sau một tai nạn bất ngờ, linh hồn của ông chú trung niên Pan-soo (tay xã hội đen máu mặt) tỉnh lại trong thân hình của Dong-hyun (cậu học sinh trung học). Với thân phận mới, Pan-soo đã quyết định tìm hiểu nguyên nhân của vụ tráo đổi kỳ lạ này, bắt đầu từ vụ tai nạn khiến Dong-hyun rơi từ trên tầng cao xuống.', '2019-01-17 17:00:00.000000', 125, 0, '2019-06-17 08:46:44.979000', '2019-06-17 08:46:44.979000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (111, 'Bí Kíp Luyện Rồng: Vùng Đất Bí Ẩn', 'https://i.moveek.com/media/cache/poster_small/media/b7071a355b643347db19088d50af3261c3197a5f.jpg', 'https://www.youtube.com/embed/TOiwiEhl0ms?hd=1', 'Sau khi Hiccup tạo ra một thế giới hòa bình cho loài rồng, Răng Sún phát hiện ra một người bạn mới đầy bí hiểm. Lúc này Hiccup đã trở thành người lãnh đạo của cả làng gánh trên vai trọng trách gìn giữ sự an nguy cho mọi người. Vì vậy, cậu không thể mãi bị cuốn theo những cuộc phiêu lưu bất tận với Răng Sún. Và khi nguy hiểm ập đến ngôi làng, cả Hiccup và Răng Sún đều đã đứng lên, anh dũng bảo vệ giống loài của mình.', '2019-02-05 17:00:00.000000', 104, 0, '2019-06-17 08:46:46.597000', '2019-06-17 08:46:46.597000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (112, 'BTS World Tour: Love Yourself in Seoul', 'https://i.moveek.com/media/resized/short/5c271b5d12420742777360.jpg', 'https://www.youtube.com/embed/-3mBQcDZEMw?hd=1', 'Bộ phim tài liệu âm nhạc này được quay trực tiếp tại sân vận động Olympic Seoul với 24 màn trình diễn mãn nhãn của nhóm nhạc BTS và qua đó, khán giả có thể cảm nhận được năng lượng, tinh thần cống hiến của BTS đến người hâm mộ nói riêng và nền âm nhạc nói chung.', '2019-01-30 17:00:00.000000', 115, 0, '2019-06-17 08:46:46.748000', '2019-06-17 08:46:46.748000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (116, 'Công Viên Kỳ Diệu', 'https://i.moveek.com/media/resized/short/5c511b2b824bc910948654.jpeg', 'https://www.youtube.com/embed/Ta8j1T3oBBo?hd=1', 'Công Viên Kỳ Diệu kể về cô bé June, người luôn mang trong mình những ý tưởng sáng tạo ngây ngô và thơ mộng nhất mà trẻ em có được. June sẽ vẽ lên công viên kỳ diệu với tên Wonderland của riêng mình và điều bất ngờ đã xảy ra, công viên trong tưởng tượng của cô bé hoàn toàn có thật.', '2019-03-14 17:00:00.000000', 85, 0, '2019-06-17 08:46:47.930000', '2019-06-17 08:46:47.930000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (120, 'Chị Trợ Lý Của Anh', 'https://i.moveek.com/media/resized/short/5c1a4cba08d1d269919956.jpg', 'https://www.youtube.com/embed/hgtxWxP5uBM?hd=1', 'Một nữ doanh nhân xinh đẹp, tài năng, đam mê công việc và đầy tham vọng; vì muốn cứu doanh nghiệp của gia đình thoát khỏi âm mưu thâu tóm của các cổ đông, cô phải chấp nhận một điều kiện là đang từ vị trí Phó tổng giám đốc một công ty Sữa chuyển sang làm Trợ lý cho một anh chàng thiếu gia “playboy” trẻ tuổi hơn – là Giám đốc một công ty Cà Phê cùng với nhiệm vụ phải tìm cho anh ta một cô bạn gái.', '2019-01-03 17:00:00.000000', 110, 0, '2019-06-17 08:46:49.190000', '2019-06-17 08:46:49.190000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (126, 'Tháng 5 Để Dành', 'https://i.moveek.com/media/resized/short/5cd0cc9fe2a1c528184670.jpg', 'https://www.youtube.com/embed/YxeW1bXmvNQ?hd=1', 'Tháng 5 Để Dành không chỉ xoay quanh câu chuyện tình cảm của Hiếu và Mai Ngọc mà còn ở những trăn trở, những “ranh giới” giới giữa bản năng và lý trí, giữa sự tò mò về giới tính của tuổi mới lớn và những rung động đầu đời. Những khó khăn, những “cám dỗ” nào sẽ dành cho cả hai, làm sao để giữ được một mối tình thanh xuân tươi đẹp và những hồi ức ngọt ngào?', '2019-05-23 17:00:00.000000', 105, 0, '2019-06-17 08:46:51.914000', '2019-06-17 08:46:51.914000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (130, 'Con Nuôi Bất Đắc Dĩ', 'https://i.moveek.com/media/cache/poster_small/media/0c0c3bc1a6ff4dd50b0dfeed5a23ed3540992a1c.jpg', 'https://www.youtube.com/embed/tDhWHXRSFC4?hd=1', 'Câu chuyện hài hước về cặp vợ chồng Pete và Ellie khi quyết định trở thành ba mẹ nuôi của 3 đứa trẻ với 3 độ tuổi và tính cách khác nhau: Cô gái tuổi teen Lizzy, cậu bé ngốc nghếch Juan và cô út luôn la hét Lita.', '2019-01-10 17:00:00.000000', 118, 0, '2019-06-17 08:46:54.215000', '2019-06-17 08:46:54.215000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (113, 'Ước Hẹn Mùa Thu', 'https://i.moveek.com/media/resized/short/5cac66225de2c172114366.jpg', 'https://www.youtube.com/embed/jUwTY1m4_yw?hd=1', 'Ước Hẹn Mùa Thu là hành trình đi tìm lại mối tình đầu sau 15 năm hôn mê của chàng trai tên Duy mà trong đó 3 yếu tố: tình yêu, tình bạn & tình địch đan xen lẫn nhau tạo nên những màu sắc rất đặc biệt. Và đó cũng chính là lời ước hẹn của tuổi trẻ mà họ - những chàng trai, cô gái đã kịp tìm lại được trước khi để những lo toan bộn bề của cuộc sống cuốn trôi đi...', '2019-05-09 17:00:00.000000', 111, 0, '2019-06-17 08:46:46.773000', '2019-06-17 08:46:46.773000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (117, 'Trạng Quỳnh', 'https://i.moveek.com/media/resized/short/5c1c55d7736df628153294.jpg', 'https://www.youtube.com/embed/2jvNTypICvA?hd=1', 'Trạng Quỳnh sẽ xoay quanh hành trình giải cứu thầy Đoàn, đồng thời là cha Điềm đầy gian truân nhưng cũng nhiều tiếng cười của những con người nhỏ bé trong xã hội phong kiến dù luôn bị chèn ép bởi tầng lớp quan lại bất công.', '2019-02-04 17:00:00.000000', 95, 0, '2019-06-17 08:46:47.985000', '2019-06-17 08:46:47.985000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (121, 'Ma Quái', 'https://i.moveek.com/media/resized/short/5c30cb73e46a9959316265.jpg', 'https://www.youtube.com/embed/Sm6ryOLZ_0s?hd=1', 'Bà đồng Helen đang huấn luyện cho hai cô gái trẻ khả năng giao tiếp với cõi âm. Trong quá trình truyền thụ, một thực thể bí ẩn đã được triệu hồi. Nó tặng cho 3 cô trò một thiết bị đặc biệt có thể thực hiện mọi ước muốn, nhưng đổi lại họ phải “trả giá” rất đắt. Liệu con quỷ hay lòng người đáng sợ hơn?', '2019-01-10 17:00:00.000000', 75, 0, '2019-06-17 08:46:50.021000', '2019-06-17 08:46:50.021000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (125, 'Tôi Muốn Ăn Tụy Của Cậu', 'https://i.moveek.com/media/resized/short/5c4145b0f1078252832283.jpg', 'https://www.youtube.com/embed/_zlPN_EI8pI?hd=1', 'Ngày nọ, nhân vật chính tìm được một cuốn nhật ký, của cô bạn cùng lớp Sakura Yamauchi, trong bệnh viện. Qua đó, cậu biết được rằng cô bạn của mình đang trải qua căn bệnh tuyến tụy giai đoạn cuối và chỉ còn sống được vài tháng mà thôi. Sakura đã nói rằng cậu là người duy nhất ngoài gia đình cô biết về sự thật này. Cậu đã hứa giữ bí mật cho Sakura. Dù tính cách của họ hoàn toàn trái ngược nhau, nhân vật chính quyết định sẽ ở bên cạnh Sakura trong những ngày tháng cuối đời của cô.', '2019-01-24 17:00:00.000000', 108, 0, '2019-06-17 08:46:50.537000', '2019-06-17 08:46:50.537000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (127, 'Vua Khủng Long: Phiêu Lưu Đến Vùng Núi Lửa', 'https://i.moveek.com/media/resized/short/5ce62492b40df842616985.jpg', 'https://www.youtube.com/embed/6Jrdb9FTX5Y?hd=1', 'Junior là một khủng long bạo chúa Taborsaurus con nhưng vô cùng yếu ớt và nhút nhát. Dino - cha của Junior lại rất khắt khe và không hài lòng với con mình. Một ngày nọ, Junior bị bọn khủng long raptor bắt cóc. Dino trên hành trình đi tìm con đã kết bạn với những loài khủng long khác. Trong khi đó, Junior cũng có thêm bạn mới, bắt đầu trưởng thành hơn và chờ đợi cha mình. Đến lúc tưởng như hai cha con đã sắp tìm thấy nhau, nguy hiểm vùng núi lửa lại ập đến. Liệu họ có vượt qua được những thử thách này?', '2019-06-13 17:00:00.000000', 92, 0, '2019-06-17 08:46:53.714000', '2019-06-17 08:46:53.714000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (136, 'Vua Khủng Long: Phiêu Lưu Đến Vùng Núi Lửa', 'https://i.moveek.com/media/resized/short/5ce62492b40df842616985.jpg', 'https://www.youtube.com/embed/6Jrdb9FTX5Y?hd=1', 'Junior là một khủng long bạo chúa Taborsaurus con nhưng vô cùng yếu ớt và nhút nhát. Dino - cha của Junior lại rất khắt khe và không hài lòng với con mình. Một ngày nọ, Junior bị bọn khủng long raptor bắt cóc. Dino trên hành trình đi tìm con đã kết bạn với những loài khủng long khác. Trong khi đó, Junior cũng có thêm bạn mới, bắt đầu trưởng thành hơn và chờ đợi cha mình. Đến lúc tưởng như hai cha con đã sắp tìm thấy nhau, nguy hiểm vùng núi lửa lại ập đến. Liệu họ có vượt qua được những thử thách này?', '2019-06-13 17:00:00.000000', 92, 0, '2019-06-17 08:47:09.924000', '2019-06-17 08:47:09.924000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (137, 'Xóm Trọ 3D: Cung Tâm Kế', 'https://i.moveek.com/media/resized/short/5c46e9ecc1701746300805.jpg', 'https://www.youtube.com/embed/aGSSxhDHjBY?hd=1', 'Chuyện phim xảy ra tại phủ Bảo Quan. Bảo Quan có 3 người vợ tên là: La Phu Nhân, Quý Phu Nhân và Y Lan Phu Nhân. Ở chung một phủ, chuyện tranh giành sự yêu thương giữa các phu nhân với nhau là chuyện rất dễ xảy ra. Mỗi ngày, các phu nhân luôn bày mưu tính kế để hãm hại nhau dẫn đến những tình huống dở khóc dở cười. Một ngày kia, Bạch Hạc, thái giám tổng quản vô tình biết được sự thật về Bảo Quan đại nhân: Bảo Quan luôn muốn được làm con gái và đã yêu thầm thị vệ Lý Tài. Vì ghen tức với Bảo Quan mà Bạch Hạc đã bày mưu tính kế nhằm lật đổ ngôi vị. Từ đó, mọi tranh chấp và toan tính bắt đầu...', '2019-02-11 17:00:00.000000', 85, 0, '2019-06-17 08:47:18.459000', '2019-06-17 08:47:18.459000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (122, 'Bí Kíp Luyện Rồng: Vùng Đất Bí Ẩn', 'https://i.moveek.com/media/cache/poster_small/media/b7071a355b643347db19088d50af3261c3197a5f.jpg', 'https://www.youtube.com/embed/TOiwiEhl0ms?hd=1', 'Sau khi Hiccup tạo ra một thế giới hòa bình cho loài rồng, Răng Sún phát hiện ra một người bạn mới đầy bí hiểm. Lúc này Hiccup đã trở thành người lãnh đạo của cả làng gánh trên vai trọng trách gìn giữ sự an nguy cho mọi người. Vì vậy, cậu không thể mãi bị cuốn theo những cuộc phiêu lưu bất tận với Răng Sún. Và khi nguy hiểm ập đến ngôi làng, cả Hiccup và Răng Sún đều đã đứng lên, anh dũng bảo vệ giống loài của mình.', '2019-02-05 17:00:00.000000', 104, 0, '2019-06-17 08:46:50.204000', '2019-06-17 08:46:50.204000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (131, 'Tân Vua Hài Kịch', 'https://i.moveek.com/media/resized/short/5c486b24a1bc2987197565.jpg', 'https://www.youtube.com/embed/XRuVpompY0I?hd=1', 'Vì đam mê làm diễn viên, vì luôn tin tưởng rằng nếu không ngừng cố gắng thì mình sẽ thành công, Tiểu Mộng dù đã mất mười mấy năm làm diễn viên quần chúng, dù bạn bè người thân liên tục can ngăn, dù đạo diễn qùy lạy xin cô đừng đi đóng phim nữa, cô vẫn luôn kiên trì theo đuổi nghiệp diễn. Tuy nhiên, lòng kiên trì bền bỉ sắt đá đó không ngờ cũng có ngày lung lay khi Tiểu Mộng phát hiện bị bạn trai lừa gạt, cuỗm đi số tiền mà cô đã chắt chiu dành dụm suốt mười mấy năm làm quần chúng. Buồn bã và nản chí, Tiểu Mộng dần từ bỏ ước mơ của mình…', '2019-02-04 17:00:00.000000', 90, 0, '2019-06-17 08:46:54.492000', '2019-06-17 08:46:54.492000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (134, 'BTS World Tour: Love Yourself in Seoul', 'https://i.moveek.com/media/resized/short/5c271b5d12420742777360.jpg', 'https://www.youtube.com/embed/-3mBQcDZEMw?hd=1', 'Bộ phim tài liệu âm nhạc này được quay trực tiếp tại sân vận động Olympic Seoul với 24 màn trình diễn mãn nhãn của nhóm nhạc BTS và qua đó, khán giả có thể cảm nhận được năng lượng, tinh thần cống hiến của BTS đến người hâm mộ nói riêng và nền âm nhạc nói chung.', '2019-01-30 17:00:00.000000', 115, 0, '2019-06-17 08:46:59.431000', '2019-06-17 08:46:59.431000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (124, 'Tân Vua Hài Kịch', 'https://i.moveek.com/media/resized/short/5c486b24a1bc2987197565.jpg', 'https://www.youtube.com/embed/XRuVpompY0I?hd=1', 'Vì đam mê làm diễn viên, vì luôn tin tưởng rằng nếu không ngừng cố gắng thì mình sẽ thành công, Tiểu Mộng dù đã mất mười mấy năm làm diễn viên quần chúng, dù bạn bè người thân liên tục can ngăn, dù đạo diễn qùy lạy xin cô đừng đi đóng phim nữa, cô vẫn luôn kiên trì theo đuổi nghiệp diễn. Tuy nhiên, lòng kiên trì bền bỉ sắt đá đó không ngờ cũng có ngày lung lay khi Tiểu Mộng phát hiện bị bạn trai lừa gạt, cuỗm đi số tiền mà cô đã chắt chiu dành dụm suốt mười mấy năm làm quần chúng. Buồn bã và nản chí, Tiểu Mộng dần từ bỏ ước mơ của mình…', '2019-02-04 17:00:00.000000', 90, 0, '2019-06-17 08:46:50.292000', '2019-06-17 08:46:50.292000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (129, 'Đường Hầm Tội Ác', 'https://i.moveek.com/media/resized/short/5ce6a8de9918d499650618.jpg', 'https://www.youtube.com/embed/EbND2NLOHPw?hd=1', 'Kỹ sư máy tính bị liệt Joaquin bắt đầu nghe thấy giọng nói và những âm thanh lạ lùng từ tầng hầm. Sau khi bí mật theo dõi mọi động tĩnh của những người hàng xóm, ông phát hiện một kế hoạch hiểm độc. Cùng lúc đó, một phụ nữ trẻ lạ mặt tới thuê trọ tại nhà Joaquin.', '2019-05-30 17:00:00.000000', 120, 0, '2019-06-17 08:46:53.989000', '2019-06-17 08:46:53.989000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (133, 'Chị Trợ Lý Của Anh', 'https://i.moveek.com/media/resized/short/5c1a4cba08d1d269919956.jpg', 'https://www.youtube.com/embed/hgtxWxP5uBM?hd=1', 'Một nữ doanh nhân xinh đẹp, tài năng, đam mê công việc và đầy tham vọng; vì muốn cứu doanh nghiệp của gia đình thoát khỏi âm mưu thâu tóm của các cổ đông, cô phải chấp nhận một điều kiện là đang từ vị trí Phó tổng giám đốc một công ty Sữa chuyển sang làm Trợ lý cho một anh chàng thiếu gia “playboy” trẻ tuổi hơn – là Giám đốc một công ty Cà Phê cùng với nhiệm vụ phải tìm cho anh ta một cô bạn gái.', '2019-01-03 17:00:00.000000', 110, 0, '2019-06-17 08:46:58.174000', '2019-06-17 08:46:58.174000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (138, 'Thật Tuyệt Vời Khi Ở Bên Em', 'https://i.moveek.com/media/resized/short/5cbd30e8f035f015898665.jpg', '', 'Việc chiến thắng bản thân quan trọng hơn việc chiến thắng đối thủ.', '2019-07-11 17:00:00.000000', 0, 0, '2019-06-17 08:47:23.658000', '2019-06-17 08:47:23.658000');
INSERT INTO public."Movies" (id, name, image, trailer, introduce, opening_day, minute_time, view, "createdAt", "updatedAt") VALUES (139, 'Avengers: Hồi Kết', 'https://i.moveek.com/media/resized/short/5ca2dd8c2d877417922349.jpg', 'https://www.youtube.com/embed/knZb5PJUSPQ?hd=1', 'Sau sự kiện hủy diệt tàn khốc, vũ trụ chìm trong cảnh hoang tàn. Với sự trợ giúp của những đồng minh còn sống sót, biệt đội siêu anh hùng Avengers tập hợp một lần nữa để đảo ngược hành động của Thanos và khôi phục lại trật tự của vũ trụ.', '2019-04-25 17:00:00.000000', 181, 0, '2019-06-17 08:47:24.357000', '2019-06-17 08:47:24.357000');
